(34, 34, 'Print the most vibrant and accurate shades of blue and green with the genuine Cyan HP C8551A toner cartridge. This original HP C8551A cartridge, or HP 822A Cyan toner, is specifically designed to mix well with Magenta and Yellow toners of your colour laser printer to create a wider colour gamut. The HP C8551A Cyan toner cartridge produces uniform gloss on the final output, and documents get better coverage so they look sharper and crisper. Minimal user intervention is required by the HP C8551A toner, enabling the small office to improve productivity and save time. ', 'Designed specifically for the printer, the HP Colour LaserJet 9500 smart printing supplies produce crisp, sharp, vibrant results every time, to meet the most challenging colour printing needs. Industry-leading print quality is combined with reliable performance for cost effective, high volume, high coverage in-house publishing. Results are further enhanced by HP\\''s second generation toner formulation, new cartridge architecture, specialty media and innovative smart printing technology.\n\nFeatures\nHP Original Toner Cartridge\nPage life approx 25,000 pages\nCyan', '800153001080', 'S-C8551A', 565, 184, 133, 1500, 'HP', '2', 'Poly Bag Size:165x230mm', 6, 'Single', 'S-C8551A', 'Single'),
