(36, 36, 'The genuine tri-colour HP 22XL ink cartridge is formulated for low-cost printing in the small but busy office. Made for superior performance and reliability, this original HP C9352CE tri-colour ink is easy to install and replace without staining the printer or your hands. The dye-based formulation of the HP 22XL ink cartridge produces text and graphics with accurate colours. A wide range of media is compatible with the tri-colour HP C9352CE printer ink, so users can print pictures and brochures and save on publishing costs.', 'HP 22XL Tri-colour Inkjet Print Cartridges are designed to print in higher-volumes with fewer cartridge changes. Print more vibrant, long-lasting colour documents and photos, and save money too.\n\nFeatures\nHP 22XL Tri-colour Inkjet Print Cartridges are designed to print in higher-volumes with fewer cartridge changes. Print more vibrant, long-lasting colour documents and photos, and save money too\nPrint more colour pages and photos with fewer cartridge changes, using a high-capacity tri-colour ink cartridge, and save money too\nShare your clear, vibrant images - even on plain paper\nPrint photos at an affordable price\nSpecially formulated dye-based ink for vibrant colours\nPrint brilliant colour documents and vibrant, long-lasting photos. Count on Original HP cartridges to deliver consistently beautiful output. Archive documents that maintain colour quality for decades without fading using Original HP inks\nCount on Original HP ink cartridges for superior reliability and performance. Original HP ink cartridges are widely available and easy to select, replace, and install', '9780099771517', '', 115, 113, 36, 81, 'HP', '2,3,4', '', 0, 'Single', 'S-C9352CE', 'Single'),
