(206, 205, 'The genuine HP C3903A Black toner cartridge is favoured by home and office users as it delivers sharp and clean results. This original Black HP C3903A toner works perfectly well with HP laser printers.', 'The genuine HP C3903A Black toner cartridge is favoured by home and office users as it delivers sharp and clean results. This original Black HP C3903A toner works perfectly well with HP laser printers. As an original product, the HPC3903A toner, or HP 03A for short, is very easy to install and keeps your printer running smoothly. Hewlett Packard fill the C3903A cartridges with microfine Black toner which has incredibly small particles that help to produce more consistent and sharp output. Get crisp text, fine lines and a low-priced toner that can print 4,000 pages, when you purchase this genuine Black HP C3903A toner cartridge.', '886980606360', '', NULL, NULL, NULL, NULL, 'HP', '1', '', 0, 'Single', 'S-C3903A', 'Single'),
