(214, 213, 'Built for heavy-duty use, the HP CE262A Yellow toner has an impressive duty capacity of up to 11,000 prints at 5% coverage, making it ideal for any sized office environment.', 'Built for heavy-duty use, the HP CE262A Yellow toner has an impressive duty capacity of up to 11,000 prints at 5% coverage, making it ideal for any sized office environment. This makes the HP CE262A toner cartridge the ideal choice for demanding print environments that require high quality and high-quantity printing. Filled to the brim with premium quality Yellow HP CE262A toner, this cartridge offers superb print results down to the final pages. The HP CE262A laser toner is an environment-friendly choice, significantly reducing printer waste and overall carbon footprint.', '884420186854', '', NULL, NULL, NULL, NULL, 'HP', '4', '', 0, 'Single', 'S-CE262A', 'Single'),
