(221, 220, 'The genuine high capacity Black HP 301XL ink cartridge gives you even more original HP ink for your money. Printing up to 2.5 times as many pages as the standard HP cartridge, this high capacity Black HP301XL ink cartridge will print approximately 480 pages and brings you significant cost savings.', 'The genuine high capacity Black HP 301XL ink cartridge gives you even more original HP ink for your money. Printing up to 2.5 times as many pages as the standard HP cartridge, this high capacity Black HP301XL ink cartridge will print approximately 480 pages and brings you significant cost savings. Black ink often runs our quickly in a busy office but this high capacity Black HP 301XL cartridge is ideal for frequent use, allowing you to print crisp Black text and images at a low cost-per-page. Featuring HP\\''s advanced ink formula, this high capacity Black HP 301XL or HP CH563EE printer cartridge produces sharp text and laser-like print speeds. Constructed from robust HP parts, this reliable HPCH563EE cartridge contains pigment ink for durable prints that resist fading for decades. Cut the costs of producing your Black and white documents and buy your ink in this high capacity HP301XL cartridge.', '884962894439', '', NULL, NULL, NULL, NULL, 'HP', '1', '', 0, 'Single', 'S-CH563EE', 'Single'),
