(244, 243, 'Helping you to create more prints at an affordable price, the HP Q2610A toner cartridge is an ideal cartridge which is essential to document production.', 'Helping you to create more prints at an affordable price, the HP Q2610A toner cartridge is an ideal cartridge which is essential to document production. Holding Black toner, the HP Q2610A toner cartridge is an integral part of the printing process and can be used for a wide range of documents, from school work to photographs. HP has manufactured the HP 10A toner cartridge according to strict rules and regulations, making the HP Q2610A toner cartridge a reliable and durable cartridge which will not fail or cause any internal printer damage. The HP Q2610A toner cartridge is specially designed to give you consistent results as well, ensuring that you\\''re able to produce quality prints well into the HP 10A toner cartridge\\''s life. Designed for average people, the HP Q2610A toner cartridge is easy to install and handle which ensures the HP Q2610A toner cartridge replacement process is over in a few quick steps, allowing you more time to print. Capable of producing up to 6,000 pages at 5% coverage, the HP 10A toner cartridge is an ideal cartridge which will ensure you\\''re always ready to print.', '808736396318', '', 390, 190, 247, 1600, 'HP', '1', '', 0, 'Single', 'S-Q2610A', 'Single'),
(245, 244, 'The HP Q2613A Black toner has an easy-to-use design and is capable of producing 2,500 pages per cartridge, making it ideal for busy print environments. It reduces downtime in between cartridges, thanks to its quick-install cartridge that easily slips into the printer\\''s HP 13A laser toner slot. ', 'The HP Q2613A Black toner has an easy-to-use design and is capable of producing 2,500 pages per cartridge, making it ideal for busy print environments. It reduces downtime in between cartridges, thanks to its quick-install cartridge that easily slips into the printer\\''s HP 13A laser toner slot. Unlike fake toners, this genuine Black Q2613A toner will ensure you get unrivalled ink quality no matter what the ink level is in the toner cartridge. The HP 13A toner unit is especially formulated to produce refined images and clear and sharp texts. If you want a toner which is capable of maintaining professional grade text and graphics throughout its usage, choose the Q2613A toner for your printer.\n\n', '808736420389', '', 333, 142, 198, 1070, 'HP', '1', '', 0, 'Single', 'S-Q2613A', 'Single'),
