(247, 246, 'Use the HP C9469A Yellow ink and receive high-quality images that will last thanks to exceptional fade resistance technology in every cartridge. ', 'Use the HP C9469A Yellow ink and receive high-quality images that will last thanks to exceptional fade resistance technology in every cartridge. The HP 91 ink cartridge offers rich ink that blends well with other colours to offer professional output that will amaze. Images are vibrant and texts are clear with the HP C9469A ink jet cartridge. Original printer products, like the HP 91 Yellow ink, are very easy to install and replace to ensure maximum ease of use. It can also help increase office productivity and keep your printer working smoothly and efficiently. With a genuine HP 91 product you can expect a high standard of print which would be ideal for an office environment where a professional finish is essential.', '882780987234', '', NULL, NULL, NULL, NULL, 'HP', '4', '', 0, 'Single', 'S-C9469A', 'Single'),
(248, 247, 'Print more pictures and vibrant colour images with the genuine HP 91 3-pack 775-ml Cyan ink cartridges. Pigment-based ink is used in the HP 91 Cyan ink cartridges for a wider colour gamut and superior lightfastness, so pictures and display media can last longer, even when displayed or archived.', 'Print more pictures and vibrant colour images with the genuine HP 91 3-pack 775-ml Cyan ink cartridges. Pigment-based ink is used in the HP 91 Cyan ink cartridges for a wider colour gamut and superior lightfastness, so pictures and display media can last longer, even when displayed or archived. The pigments in each HP C9483A multipack ink cartridge can last in-window for 1+ years unlaminated, 3+ years laminated or 200+ years if kept away from direct sunlight. Ideal for producing photo-quality images, these 3 x Cyan HP 91 inks produce brilliant colour output and crisp lines. This genuine HP C9483A Cyan triple pack is compatible with easy management tools of the printer, so users will know when it\\''s time for a replacement. The Cyan HP 91 print cartridge 3-pack is compatible with more media types, including glossy sheets and recycled paper.', '883585034857', '', NULL, NULL, NULL, NULL, 'HP', '2', '', 0, 'Single', 'S-C9483A', 'Single'),
(249, 248, 'Designed for budget-friendly printing, this genuine J3M83AE multipack gives you 4 high-capacity genuine HP 364XL inks, all offering impressive page yields.', 'Designed for budget-friendly printing, this genuine J3M83AE multipack gives you 4 high-capacity genuine HP 364XL inks, all offering impressive page yields. This genuine HP 364XL multipack includes a 550-page Black cartridge, along with 750-page colour cartridges, each dispensing a fine formulation of HP 364XL inks that allow rich, vibrant, and long-lasting print results. Ideal for budget-conscious users, this genuine HP 364XL ink pack pulls down print costs to an affordable pence per page.', '8887933068718', '', NULL, NULL, NULL, NULL, 'HP', '2,3,4,1', '', 0, 'Single', 'S-J3M83AE', 'Single'),
(250, 249, 'HP 337 Black Inkjet Print Cartridge with Vivera Ink prints darker, laser-quality Black text that offers greater resistance to highlighter pen smear.', 'Black HP 337 ink cartridge (also know as HP C9364EE ink) with Vivera Ink prints darker, laser-quality Black text that offers greater resistance to highlighter pen smear. This Black HP 337 ink cartridge delivers enhanced durability and superior fade-resistance, so you can produce attention-grabbing charts and graphics and rich deep Blacks with HP\\''s exclusive Vivera Ink formulation. The innovative HP 337 cartridge design incorporates a wide 9/16 inch print swath enabling impressively fast print speeds.', '829160799049', '', 36, 116, 115, 67, 'HP', '1', '', 0, 'Single', 'S-C9364EE', 'Single'),
