(253, 252, 'HP 364XL Photo Ink Cartridge is designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. Does not work in printers with only 4 slots. ', 'HP 364XL Photo Ink Cartridge is designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. Does not work in printers with only 4 slots. The Photo ink cartridge will not fit in the Black cartridge slot. Designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. The HP 364XL Photo Ink Cartridge does not work in printers with only 4 slots. The Photo ink cartridge will not fit in the Black cartridge slot. Save more and get a better value - use optional high-capacity XL cartridges. With Original HP ink cartridges, you can print easily and affordably. These convenient individual ink cartridges can be replaced one at a time as needed. Get impressive results for all your photos, creative projects and everyday prints, using inks designed to meet all your printing needs. Print long-lasting, lab-quality photos and projects.', '883585705801', '', 24, 107, 115, 50, 'HP', '1', '', 0, 'Single', 'S-CB322EE', 'Single'),
(254, 253, 'HP 300 Tri-colour Ink Cartridges let you easily print vivid colour documents, reports and letters at an affordable price. This Original HP ink cartridge is designed to deliver user-friendly features and consistent, reliable performance.', 'The genuine Black & tri-colour HP 300 ink cartridge multipack allows you to buy your ink cartridges in a twin pack to save time and money. This original HP CN637EE ink cartridge twin pack contains 1 x Black HP 300 ink cartridge (CC640EE) and 1 x tri-colour HP 300 ink cartridge (CC643EE). HP 300 printer cartridges are specially formulated with long-lasting HP ink that resists fading and produces crisp text and colour quality that maintains its perfect image quality for many years to come. The Black HP 300 ink cartridge produces laser-like text characters to give your documents a professional touch. Meanwhile, printing vibrant, eye-catching graphics is even easier because the tri-colour HP 300 ink cartridge gives you a combination of Cyan, Magenta and Yellow inks in a single cartridge that you can easily install alongside your Black HP CC640EE cartridge. Pay less for your ink and buy your Black and colour cartridges together in the cost-effective HP CN637EE multipack.', '884962770160', '', 38, 117, 170, 111, 'HP', '1,2,3,4', '', 0, 'Single', 'S-CN637EE', 'Single'),
(255, 254, 'HP 21XL Black Inkjet Print Cartridges are designed to print in higher-volumes with fewer cartridge changes. Print more rich, laser-quality Black text and save money too. Ideal for printing laser-quality Black text for home use, home and small offices.', 'HP 21XL Black Inkjet Print Cartridges are designed to print in higher-volumes with fewer cartridge changes. Print more rich, laser-quality Black text and save money too. Ideal for printing laser-quality Black text for home use, home and small offices. High-capacity ink cartridge prints 2.5 times more printed pages with fewer cartridge changes while providing better cost per page for frequent printing customers. Count on Original HP ink cartridges for superior reliability and performance. Original HP ink cartridges are widely available and easy to select, replace, and install.', '884962780763', '', 36, 113, 115, 47, 'HP', '1', '', 0, 'Single', 'S-C9351CE', 'Single'),
(256, 255, 'HP 301 Black Ink Cartridges are designed to deliver user-friendly features and great value. Print documents with laser-quality Black text and sharp images that resist fading. Get user-friendly features and great value. ', 'The genuine Black HP 301 ink cartridge gives you outstanding print performance and unbeatable value. This user-friendly HP 301 printer cartridge is officially designed by Hewlett Packard, a market leader in terms of quality and innovation. Featuring HP\\''s advanced ink formula, the HP301 cartridge produces laser-like text that is ideal for printing professional quality office documents including reports, newsletters and web prints. Also known as the HP CH561EE ink cartridge, this original HP supply contains pigment-based ink to give your prints extra durability and ensures that your documents resist fading for decades. The Black HPCH561EE ink cartridge is the next big thing in HP printing and is the result of many years of innovation and design.', '884962894385', '', 37, 113, 115, 50, 'HP', '1', '', 0, 'Single', 'S-CH561EE', 'Single'),
(257, 256, 'HP 301 Tri-colour Ink Cartridges are designed to deliver user-friendly features, including technology that lets you finish printing a critical job even when youre low on a specific ink. Easily print vivid colour documents, reports and letters.', 'The genuine tri-colour HP 301 ink cartridge is designed to print eye-catching graphics that will bring your pages to life. Containing original HP ink, this tri-colour HP 301 printer cartridge is also known as the HP CH562EE ink cartridge and uses specially formulated dye-based ink to bring you superb colour vibrancy. The tri-colour HP301 cartridge contains Cyan, Magenta and Yellow inks within a single, compact cartridge. Easy to use and replace, this convenient tri-colour HP CH562EE inkjet cartridge produces vivid colours and sharp images that resist fading for decades. When used in-conjunction with ColorLok papers, this tri-colour HP 301 ink will deliver enhanced image quality with richer, brighter graphics as well as faster drying times that result in reduced smearing. With an estimated capacity of 165 pages, the tri-colour HP No.301 cartridge offers an inexpensive solution for printing in vibrant colours.', '884962894484', '', 37, 113, 115, 60, 'HP', '2,3,4', '', 0, 'Single', 'S-CH562EE', 'Single'),
(258, 257, 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text.', 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text. Ideal for families and personal users producing a large-volume of everyday prints. Perfect for greeting cards, letters, e-mail, photos and graphics. Get results you can count on across a broad range of plain papers and speciality media. Save money with economical and convenient HP Combo-pack Inkjet Print Cartridges. Contains one Black and one tri-colour Inkjet print cartridge to meet your everyday printing needs, and costs less than two individual cartridges bought separately. HP 21 and 22 Inkjet Print Cartridges produce professional-looking documents and true-to-life, colour-accurate photos. Print crisp, laser-quality text for your letters and reports, and brilliant, long-lasting colour photographs and graphics.', '883585651719', '', 38, 117, 170, 123, 'HP', '1,2,3,4', '', 0, 'Single', 'S-SD367AE', 'Single'),
(259, 258, 'Featuring Epson\\''s DURABrite Ultra ink formula, these Epson T0711 ink cartridges are perfect for printing beautiful, durable results on all types of paper with rich Blacks and crisp quality.', 'Featuring Epson\\''s DURABrite Ultra ink formula, these Epson T0711 ink cartridges are perfect for printing beautiful, durable results on all types of paper with rich Blacks and crisp quality. The T0711 can also be bought as part of the Epson T0715 multi-pack offering a further saving. Designed to work with a range of Epson printers, the Epson T0711 cartridge (also known by its part number of C13T07114010 and easily spotted by the cheetah picture on the front of the pack) provides superior fade, smudge and water resistance.', '8715946495439', '', 30, 112, 142, 50, 'EPSON', '1', '', 0, 'Single', 'S-C13T07114011', 'Single'),
(260, 259, 'Ideal for everyday printing, Epson DURABrite Ultra Ink is perfect for printing high-quality documents and lab-quality photos, thanks to the unique pigment-based ink technology encapsulates ink particles in a protective resin coating.', 'Featuring Epson\\''s DURABrite Ultra ink formula, these Epson T0711 ink cartridges are perfect for printing beautiful, durable results on all types of paper with rich Blacks and crisp quality. The T0711 can also be bought as part of the Epson T0715 multi-pack offering a further saving. Designed to work with a range of Epson printers, the Epson T0711 cartridge (also known by its part number of C13T07114010 and easily spotted by the cheetah picture on the front of the pack) provides superior fade, smudge and water resistance. Buy your Epson T0711 printer cartridges today!', '8715946384825', '', 112, 30, 142, 50, 'EPSON', '1', '', 0, 'Single', 'S-C13T07114H10', 'Single'),
(261, 260, 'The genuine high capacity Black Epson C13T12914011 ink cartridge gives you more Epson DURABRrite Ultra Ink for your money and allows you to print with maximum cost-efficiency.', 'The genuine high capacity Black Epson C13T12914010 ink cartridge gives you more Epson DURABRrite Ultra Ink for your money and allows you to print with maximum cost-efficiency. This high capacity Black Epson T1291 ink cartridge prints perfectly formed Black text and sharp images onto a range of paper types. Siutable for use on plain, glossy or matte type papers, this versatile Epson C13T129140 ink is smudge-proof, water-resistant and lightfast, making Epson T1291 ink the perfect solution for creating durable prints and archival documents. Containing resin-caoted pigment ink, the Black Epson T1291 ink cartridge gives you laser-like text reproduction and comes in a high capacity cartridge to deliver a low cost-per-page output. Constructed from official Epson parts, this original Black Epson T1291 cartridge comes in an independent ink tank to maximise cartridge life and bring you better value.', '8715946494500', '', NULL, NULL, NULL, NULL, 'EPSON', '1', '', 0, 'Single', 'S-C13T12914011', 'Single'),
