(265, 264, 'HP 338/343 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text.', 'The genuine Black HP 338 & tri-colour HP 343 ink cartridge multipack offers you a cheaper and easier way to buy your HP ink cartridges. This economical HP SD449EE twin pack contains 1 x back HP 338 ink cartridge (C8765EE) and 1 x tri-colour HP 343 ink cartridge (C8766EE) for full colour printing. Designed to print long-lasting, photos, text and graphics, the HP338 and HP343 ink cartridges can now be purchased together to cut the cost of buying individual cartridges. The Black HP 338 cartridge contains pigment ink for printing laser-quality text that is suitable for important office documents such as letters or reports. Meanwhile, the tri-colour HP343 cartridge contains dye-based inks in Cyan, Magenta and Yellow colours and is used to produce eye-catching graphics or photo prints with vivid colours and true-to-life image quality', '884962520246', '', 38, 117, 170, 126, 'HP', '1,2,3,4', '', 0, 'Single', 'S-SD449EE', 'Single'),
(266, 265, 'HP 951XL Officejet Value Pack prints impressive text and graphics, using Original HP media and HP Officejet inks. Produce affordable, long-lasting professional-quality flyers and office documents at your home or office. Save on ink and paper when you buy them together in one affordable set.', 'Get great value for money with the HP CR712AE 3 colour multipack with A4 photo paper. The HP CR712AE photo pack consists of three high capacity Cyan, Magenta, and Yellow ink cartridges plus 75 sheets of A4 paper. You can produce high quality images with vibrant colours using this original HP CR712AE photo pack which gives you everything you need for colour printing. Your HP printer will run smoothly with the Hewlett Packard CR712AE ink cartridges installed and genuine HP photo paper to print on. The cartridges within this 3 colour CR712AE pack are also known as high capacity HP 951XL ink cartridges.', '886111754267', '', 34, 222, 310, 890, 'HP', '2,3,4', '', 0, 'Single', 'S-CR712AE', 'Single'),
(267, 266, 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance.', 'Making sure that you can print at a moment\\''s notice, the HP Q7551XD toner cartridge twin pack supplies you with two HP 51XD toner cartridges in order to allow you to save time and money. Constructed originally by HP, the HP Q7551XD toner cartridge twin pack is put together carefully and with attention to detail in order to make sure that the HP Q7551XD toner cartridge twin pack gives you plenty of results with minimal fuss. Made with the average user in mind, the HP 51XD toner cartridge is highly useful as it is a Black toner cartridge, thus meaning that the HP 51XD toner cartridge can be used in the majority of prints. Capable of producing up to 13,000 pages at 5% coverage each, the HP 51X toner cartridges included in the HP Q7551XD toner cartridge twin pack will make sure your prints have a professional quality that you can be proud of without costing too much money. The HP Q7551XD toner cartridge twin pack is ideal for a busy printing environment because the HP Q7551XD toner cartridge twin pack supplies you with two toner cartridges, thus eliminating the need to constantly reorder new HP 51X toner cartridges when you\\''re done with them.', '883585945009', '', 331, 392, 329, 320, 'HP', '1', '', 0, 'Single', 'S-Q7551XD', 'Single'),
(268, 267, 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance.', 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance. Accurate colour, precise image reproduction and crisp, sharp text every time you print. Chemically-grown toner and HP Smart printing system technology deliver consistent results and reliable performance throughout the life of the cartridge. HP Smart technology makes automatic adjustments to optimize print quality and enhance reliability. Minimal user intervention saves time, improves productivity and lowers overall printing costs. Enjoy low maintenance, trouble-free printing. HP Smart technology in the toner cartridge and your printer makes HP supplies easy to install and maintain. Receive automatic alerts when a cartridge is low or out.', '882780984905', '', 397, 395, 332, 630, 'HP', '1', '', 0, 'Single', 'S-Q5942XD', 'Single');
