(58, 58, 'Print high-quality results while ensuring full system reliability with the genuine Black & tri-colour HP 27 & HP 28 ink cartridge multipack.', 'Print high-quality results while ensuring full system reliability with the genuine Black & tri-colour HP 27 & HP 28 ink cartridge multipack. The genuine HP 27 & 28 printer inks can be used on everyday papers, transparencies, and HP specialty inkjet media, making them versatile for printing documents, presentations, and marketing materials. The genuine HP 27 & 28 multipack has dye-based colour inks for vibrant photos and richer colours, and pigment-based Black ink that produces crisp, sharp, and solid text.', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(59, 59, 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text. Ideal for families and personal users producing a large-volume of everyday prints. Perfect for greeting cards, letters, e-mail, photos and graphics.', '', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(60, 60, 'The HP 336 and HP 342 multipack contains the light user Black HP C9362EE ink and the light user tri-colour HP C9361EE ink cartridge. These original HP 336 and 342 inks produce lightfast and resilient photos and documents that can resist fading. The genuine HP342 / HP336 ink is made using Vivera formulation, which improves ink adherence and the longevity of output.', 'The HP 336 and HP 342 multipack contains the light user Black HP C9362EE ink and the light user tri-colour HP C9361EE ink cartridge. These original HP 336 and 342 inks produce lightfast and resilient photos and documents that can resist fading. The genuine HP342 / HP336 ink is made using Vivera formulation, which improves ink adherence and the longevity of output. The HP 336 and 342 multipack is suitable for occasional printing of documents and photos. Realistic photos can be produced with clearer and sharper details as the genuine HP342 Black ink and HP336 colour ink can produce crisp Blacks and a wide colour gamut. It can be cheaper to buy the HP 336 and 342 multipack than to buy the ink cartridges separately.', NULL, '0', 126, 114, 36, 82, 'HP', '', 0, ''),
(61, 61, 'HP 300 Tri-colour Ink Cartridges let you easily print vivid colour documents, reports and letters at an affordable price. This Original HP ink cartridge is designed to deliver user-friendly features and consistent, reliable performance. Bring a new level of accuracy and professionalism to your work and enjoy the reliable, trouble-free printing of Original HP supplies. HP Vivera Inks are designed and tested with the printer to provide consistent results. Intelligence built into the cartridge interacts with the system to make Original HP supplies easy to use and manage with time-saving features. Enjoy convenient reordering. ', '', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(62, 62, 'Print affordable, impressive colour documents, using HP Officejet ink. Consistently produce high-quality colour graphics that resist fading. These cartridges offer user-friendly features and reliable performance.', 'Produce laser-like text and vibrant graphics with the genuine Black and tri-colour HP 901 ink cartridge multipack. This pack contains a pigment-based HP CC653AE Black ink and a dye-based HP CC656AE tri-colour ink cartridge, and they\\''re cheaper to buy in a single pack than separately. The genuine HP 901 ink pack provides users with a ready replacement when a cartridge runs out of ink, enabling them to save time. These original HP901 Black and colour ink cartridges are compatible with ColorLok-certified office papers. The cartridges of the genuine HP 901 inkjet value pack work with each other to complete a print job, even when the other one is already low on ink.', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(63, 63, 'Help the environment and save money by using the high capacity Black HP 901XL and tri-colour HP 901 ink cartridge multipack. ', '', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(64, 64, 'Print high quality documents and graphics for the office and save money in the long run by using the genuine 4 colour HP 970 / HP 971 ink cartridge multipack. Featuring the HP 970 Black ink cartridge and the HP 971 colour ink cartridges (Cyan, Magenta and Yellow) this multipack is cheaper than buying the cartridges separately. With the Black HP CN621AE ink, the Cyan HP CN622AE ink, the Magenta HP CN623AE ink and the Yellow HP CN624AE ink contained in this pack, fast-drying and water resistant prints can be produced thanks to the resilient pigment ink formula.', 'Print high quality documents and graphics for the office and save money in the long run by using the genuine 4 colour HP 970 / HP 971 ink cartridge multipack. Featuring the HP 970 Black ink cartridge and the HP 971 colour ink cartridges (Cyan, Magenta and Yellow) this multipack is cheaper than buying the cartridges separately. With the Black HP CN621AE ink, the Cyan HP CN622AE ink, the Magenta HP CN623AE ink and the Yellow HP CN624AE ink contained in this pack, fast-drying and water resistant prints can be produced thanks to the resilient pigment ink formula. The genuine HP970 and HP971 supplies have built-in HP Smart Technology for timely cartridge replacement. The HP 970 Black cartridge lasts for approximately 3,000 pages and each of the HP 971 colour cartridges can print approximately 2,500 pages.', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(65, 65, 'The pigment ink formulation in the genuine high capacity 4 colour HP 970XL and HP 971XL 4 colour ink cartridges ensures durable, quick-drying results when printing colour and monochrome documents or images. The HP 970XL and 971XL ink pack features four high yield cartridges including the HP CN625AE Black cartridge, HP CN626AE Cyan cartridge, HP CN627AE Magenta cartridge and HP CN628AE Yellow cartridge. Original HP No.', 'The pigment ink formulation in the genuine high capacity 4 colour HP 970XL and HP 971XL 4 colour ink cartridges ensures durable, quick-drying results when printing colour and monochrome documents or images. The HP 970XL and 971XL ink pack features four high yield cartridges including the HP CN625AE Black cartridge, HP CN626AE Cyan cartridge, HP CN627AE Magenta cartridge and HP CN628AE Yellow cartridge. Original HP No. 970XL and No. 971XL inks are designed to save time and money by producing consistent and long-lasting output without any errors. Pictures and text can dry fast upon printing, and they resist moisture because of the high quality pigments in the high capacity Black HP 970XL ink and high capacity Cyan, Magenta and Yellow HP 971XL ink. Users can save further because the 4 colour HP970XL / HP971XL high capacity ink pack is cheaper than buying the cartridges separately. More ink in the high capacity 970XL and 971XL supplies also means a cheaper cost-per-print.', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(66, 66, 'Designed for budget-friendly printing, this genuine multicolour gives you 4 high-capacity genuine HP 364XL inks, all offering impressive page yields.', 'Designed for budget-friendly printing, this genuine multicolour gives you 4 high-capacity genuine HP 364XL inks, all offering impressive page yields. This genuine HP 364XL multipack includes a 550-page Black cartridge, along with 750-page colour cartridges, each dispensing a fine formulation of HP 364XL inks that allow rich, vibrant, and long-lasting print results. Ideal for budget-conscious users, this genuine HP 364XL ink pack pulls down print costs to an affordable pence per page.', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(67, 67, 'The genuine high capacity Black HP CN684EE ink cartridge is the ideal solution for saving money. Designed to print more than twice as many pages as a standard HP 364 cartridge, this high capacity HP 364XL ink cartridge maximises your productivity and minimises your cost-per-page ratio. Filled with original HP ink for superior print quality, this high capacity Black Hewlett Packard CN684EE printer cartridge produces rich Blacks for improved contrasts and sharper, clearer text. \nThe genuine 4 colour HP 364 ink cartridge multipack is designed to save you money by incorporating 4 cartridges into one combo-pack. Manufactured to HP\\''s strict quality standards, these original HP 364 ink cartridges deliver superb print quality and reliablity. The HP364 combo pack is alternatively known as the HP J3M82AE multipack and contains the following items:\n\n1 x Black HP 364 Ink Cartridge (CB316EE)\n1 x Cyan HP 364 Ink Cartridge (CB318EE)\n1 x Magenta HP 364 Ink Cartridge (CB319EE)\n1 x Yellow HP 364 Ink Cartridge (CB320EE)\n10 x sheets of 13 x 18cm HP photo paper\n5 x original HP envelopes', 'The genuine high capacity Black HP CN684EE ink cartridge is the ideal solution for saving money. Designed to print more than twice as many pages as a standard HP 364 cartridge, this high capacity HP 364XL ink cartridge maximises your productivity and minimises your cost-per-page ratio. Filled with original HP ink for superior print quality, this high capacity Black Hewlett Packard CN684EE printer cartridge produces rich Blacks for improved contrasts and sharper, clearer text. Additional features of HP CN684EE ink are its water, smudge and fade resistant formula that allows you to print durable office documents without worrying about quality constraints. Previously known as HP CB321EE ink, the high capacity Black HP 364XL cartridge has the new part number HP CN684EE and now comes with a capacity of approximately 550 pages\nThe HP364 combo pack is alternatively known as the HP J3M82AE multipack and contains the following items:\n\n1 x Black HP 364 Ink Cartridge (CB316EE)\n1 x Cyan HP 364 Ink Cartridge (CB318EE)\n1 x Magenta HP 364 Ink Cartridge (CB319EE)\n1 x Yellow HP 364 Ink Cartridge (CB320EE)\n10 x sheets of 13 x 18cm HP photo paper\n5 x original HP envelopes\nThe HP J3M82AE multi-pack contains official HP 364 inks and photo paper plus envelopes to bring you perfect results on Black or colour prints. The Black HP CB316EE printer cartridge is filled with pigment based ink for increased durability, water-resistance and the capability to print crisp, clear Black text. Meanwhile, the HP CB318EE, CB319EE and CB320EE inks contain a specially formulated dye and use Vivera ink technology for millions of possible colour combinations that will bring your photos to life.', NULL, '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
