(74, 74, 'The Genuine HP 364 Magenta Ink Cartridge (CB319EE) with dye-based Vivera Ink is designed to deliver radiant colour printing. The use of dye rather than pigment ink allows bright and vivid colour images plus also helps to produce a smooth finish on all glossy photo paper. At the same time Vivera Inks are extremely durable and are excellent for long-lasting photos. This HP 364 Cartridge has the capacity to print approximately 300 pages at 5% coverage. For those looking for even greater value, the HP 364, four colour multipack is also available, and includes not only the Magenta HP 364 (CB319EE) but also the, Black, Yellow and Cyan cartridges.', 'HP 364 Magenta Ink Cartridge prints lab-quality photos. Rely on HP for superior quality printing and easy ways to recycle ink cartridges. Produce water-, smudge- and fade-resistant prints, using individual inks and HP Advanced Photo Paper. Print long-lasting, lab-quality photos. Get impressive results for all your photos, creative projects and everyday prints. Print beautiful photos that dry instantly and resist water and smudges, using HP Vivera inks with HP Advanced Photo Paper. With Original HP ink cartridges, you can print easily and affordably. Load cartridges with ease - unique colour and fit help ensure that the right ink cartridge is in the right place. Original HP ink cartridges offer superior reliability and performance.\n\nFeatures\nEnduring, lab-quality photos and documents\nVersatile, economical 5-ink printing\nCount on HP for a superior printing experience', '883585705443', '0', 115, 107, 24, 30, 'HP', '', 0, ''),
