(78, 78, 'HP 824 LaserJet Printing Supplies give you fast, brilliant results with enhanced HP ColorSphere toner. With reliable, consistent performance and time-saving supplies management features, using Original HP supplies means high productivity. Designed to meet a wide range of needs. Enhanced ColorSphere toner achieves consistent, high-gloss to produce a dynamic range of brilliant colour.', 'HP 824 LaserJet Printing Supplies give you fast, brilliant results with enhanced HP ColorSphere toner. With reliable, consistent performance and time-saving supplies management features, using Original HP supplies means high productivity. Designed to meet a wide range of needs. Enhanced ColorSphere toner achieves consistent, high-gloss to produce a dynamic range of brilliant colour. From effective everyday business documents to professional marketing pieces, the results are brilliant. Reliable printing drives productivity. ColorSphere toner and intelligence built into the cartridge enable fast, high-quality, reliable printing. Trouble-free printing can save time, increase productivity and lower your overall costs of printing. Keep the office running smoothly with manageability features enabled by Original HP toner cartridges. Intelligence built-into the cartridge communicates with the printer to track usage and provide alerts, so it\\''s easy to keep supplies on hand.\n\nFeatures\nBrilliant colour, brilliant results\nReliable performance for high productivity\nIncreased end-user satisfaction and reduced administrative time\nPage yield approx 35,000 pages\nMagenta', '882780459182', '0', 611, 333, 171, 3900, 'HP', '', 0, ''),
(79, 79, 'HP 711 3-pack 29-ml Yellow Ink Cartridge provides consistent, accurate results. See rich colour and sharp line accuracy in fast-drying, smudge-resistant prints. Original HP inks are designed and tested with your printer to provide consistent results. Designed for AEC students, AEC professionals and freelancers, construction offices, universities and small AEC workteams. Trial and error costs you time. To get the consistent quality you need, look to Original HP supplies designed with your printer as an optimised printing system to provide accurate lines, sharp detail and rich colour quality.', 'HP 711 3-pack 29-ml Yellow Ink Cartridge provides consistent, accurate results. See rich colour and sharp line accuracy in fast-drying, smudge-resistant prints. Original HP inks are designed and tested with your printer to provide consistent results. Designed for AEC students, AEC professionals and freelancers, construction offices, universities and small AEC workteams. Trial and error costs you time. To get the consistent quality you need, look to Original HP supplies designed with your printer as an optimised printing system to provide accurate lines, sharp detail and rich colour quality. Choose the size to fit your needs and your budget whether you print a little or a lot. Colour cartridge 3-packs keep you working, not running to the store. Intelligence built into the cartridge and printer alerts you when it\\''s time for a replacement. Imagine the impact you can make with clear, easily readable drawings and colourful, powerful presentations. Original HP inks deliver a unique combination of quality and resilience - see sharp lines in fast-drying, smudge-resistant prints.\n\nFeatures\nHP Original Inkjet Cartridge\n29ml ink capacity per cartridge\nManufacturers Reference: CZ136A (No.711)\nYellow\nPacked 3', '886112841195', '0', 126, 119, 46, 180, 'HP', '', 0, ''),
(80, 80, '', 'The HP 83 UV Ink Cartridges are part of a modular ink system that delivers fast printing automatically. The HP 83 UV Colour ink system and newly formulated pigment-based inks offer the smoothest Colour transitions offered by HP large-format printers. \\"Smart chips\\" embedded in each of the HP 83 UV ink cartridges and printheads monitor ink usage, track printhead wear, and alert you when it\\''s time to replace your supplies. HP 83 ink supplies are HP-engineered and tested to work precisely with HP Designjet 5000 series printers and compatible HP printing material to deliver the professional results you expect.\n\nFeatures\nHP\\''s Jetexpress technology helps achieve unmatched speeds - up to 52.8 square meters per hour (printing 600 dpi, maximum speed mode, on HP Coated Paper).\nHP No. 83 pigment-based inks are newly formulated to deliver the most brilliant, photo-realistic images and vivid, full-color graphics that are lightfast and durable - indoors and outside.\nIdeal for outdoor or durable indoor prints, such as posters, banners, window displays.\n32 MB Flash Memory', '25184252755', '0', 320, 114, 56, 950, 'HP', '', 0, ''),
(81, 81, 'The genuine HP 83 680-ml light Cyan UV ink cartridge dispenses UV-resistant HP C4944A ink that offers excellent print longevity and photo-realistic outputs. Ideal for full colour graphics and image printing, the HP C4944A ink boasts a fine formulation of pigment-based ink that complements the precise print technology of HP\\''s JetExpress printers. The HP 83 light Cyan ink cartridge dispenses micro-fine drops of HP C4944A ink for more accurate and smoother print results. Work at fast print speeds and get unrivalled performance for UV-resistant inkjet printing using this original HP C4944A printer cartridge.', 'The HP 83 UV Ink Cartridges are part of a modular ink system that delivers fast printing automatically. The HP 83 UV Colour ink system and newly formulated pigment-based inks offer the smoothest Colour transitions offered by HP large-format printers. \\"Smart chips\\" embedded in each of the HP 83 UV ink cartridges and printheads monitor ink usage, track printhead wear, and alert you when it\\''s time to replace your supplies. HP 83 ink supplies are HP-engineered and tested to work precisely with HP Designjet 5000 series printers and compatible HP printing material to deliver the professional results you expect.\n\nFeatures\nHP\\''s Jetexpress technology helps achieve unmatched speeds - up to 52.8 square meters per hour (printing 600 dpi, maximum speed mode, on HP Coated Paper).\nHP No. 83 pigment-based inks are newly formulated to deliver the most brilliant, photo-realistic images and vivid, full-color graphics that are lightfast and durable - indoors and outside.\nIdeal for outdoor or durable indoor prints, such as posters, banners, window displays.\n32 MB Flash Memory', '25184252786', '0', 320, 114, 56, 950, 'HP', '', 0, ''),
