(86, 86, 'The genuine extra high capacity Yellow Epson C13T13044010 ink cartridge allows you to create even more beautiful colour prints with true Epson quality. Featuring DURABrite Ultra Ink for superior print performance, this extra high capacity Yellow Epson T1304 cartridge contains resin-coated pigment ink that offers increased fade, water, and smudge-resistance to conventional dye-based inks. Containing more ink than the high capacity cartridge, this extra high capacity Yellow Epson C13T130440 ink cartridge is extremely economical and makes your money go further by reducing waste and minimising the need for replacements. The extra high capacity Yellow Epson T1304 ink comes in an individual ink tank so you only replace the cartridge once the full capacity of ink is depleted. Print rich, vibrant colours with true-to-life image quality from this Yellow Epson T1304 ink cartridge that is perfectly suited to photo-printing and will work consistently on a range of media including plain, glossy and matte type papers.', 'Whether creating web pages, office documents or school projects, Epson DURABrite Ink is ideal. And as it is resistant to both water and smudging, its the perfect ink for printing glossy, lab-quality photos.\n\nFeatures\nEpson Inkjet Cartridge\nExtra large\nCapacity: 10.1ml\nYellow\nFor perfect results every time, Epson genuine ink gives a durable and vibrant outcome for all your documents and photos\nWhether you are creating colourful school projects, printing web pages, or producing your own glossy photo album, Epson offers you the best results from your Epson Printer', '8715946465708', '0', NULL, NULL, NULL, 0, 'Epson', '', 0, ''),
