(146, 145, 'The genuine high capacity 4 colour Epson C13T12954010 ink cartridge multipack is specifically designed for Epson printers and contains the following high capacity ink cartridges in one brilliant value pack', 'This 4 colour Epson T1295 multipack offers you the cheapest and easiest way to purchase your replacement Epson cartridges. Not only do you get a discount on your Epson T1291, T1292, T1293 and T1294 ink by purchasing them together, you also have the convenience of receiving all your colour cartridges at the same time. The Epson T1295 ink cartridges contain DURABrite Ultra Ink for superior print performance. This resin-coated pigment ink is fade, water and smudge resistant, leaving you with durable prints that will last for up to 200 years when stored in a photo album. The 4 colour Epson C13T12954010 ink multipack produces bright, vivid colours that leap off the page and bring your photos to life. Designed to print reliably on plain, glossy or matte paper types, these versatile Epson C13T129540 ink cartridges give you stunning results first time, every time.', '8715946465586', '0', 214, 191, 24, 141, 'Epson', '', 0, ''),
