(171, 170, 'Ensure superior quality and dependable results on each print with the genuine Black HP 950XL ink cartridge. ', 'The pigment-based formulation of the HP CN045AE Black ink guarantees laser quality documents with sharper text and finer lines, while monochrome graphics can retain their details even if they were originally coloured. More ink is in the cartridge, so users can save money and time between changing inks. With the CN045AE Black ink cartridge, you can expect an estimated 2,300 pages of high quality print, making this cartridge ideal for a small to medium sized office environment. The HP 950XL ink jet cartridge is also designed to be environment-friendly and it can be recycled by HP when it runs out.', '886111615155', '0', 119, 125, 36, 154, 'HP', '', 0, ''),
