(173, 172, 'The genuine Black Canon CLI-521BK ink cartridge works with selected Canon inkjet printers to offer exceptional quality printing for photos. ', 'The genuine Black Canon CLI-521BK ink cartridge works with selected Canon inkjet printers to offer exceptional quality printing for photos. This dye-based Black Canon CLI-521BK ink can replace the Black pigment ink to enhance your photos. The more neutral Black provided by this CLI-521 ink improves contrasts, especially in Black and white photos.\n\nThis original Canon CLI-521BK ink cartridge offers exceptional value for money and is manufactured by Canon, using quality materials which you can depend on time after time. Start printing better quality photos and pick up your Black Canon CLI-521 printer cartridge today!', '4960999577470', '0', NULL, NULL, NULL, 3425, 'Canon', '', 0, ''),
