(218, 217, '', 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance. Accurate colour, precise image reproduction and crisp, sharp text every time you print. Chemically-grown toner and HP Smart printing system technology deliver consistent results and reliable performance throughout the life of the cartridge. HP Smart technology makes automatic adjustments to optimize print quality and enhance reliability. Minimal user intervention saves time, improves productivity and lowers overall printing costs. Enjoy low maintenance, trouble-free printing.\n\nFeatures\nIdeal for value-conscious customers printing high volumes of professional-quality documents\nOriginal HP LaserJet dual packs offer better value than individual cartridges\nOriginal HP LaserJet Toner Cartridges are designed together with HP printers to offer outstanding performance', '887111315649', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(219, 218, 'Designed for demanding office environments, the genuine HP CF210A Black toner is ideal for producing business-quality documents. Capable of producing approximately 1,600 pages of high quality print, your cost-per-page will be kept low with this HP CF210A laser toner.', 'Designed for demanding office environments, the genuine HP CF210A Black toner is ideal for producing business-quality documents. Capable of producing approximately 1,600 pages of high quality print, your cost-per-page will be kept low with this HP CF210A laser toner. The genuine HP CF210A toner can deliver crisp documents with sharp and dark texts. Easy installation and ease of use can also be expected with this HP CF210A cartridge thanks to it being an original HP product. You may also produce bold greyscale images with fine details using the genuine HP 131A Black toner. With its reliability, the genuine HP CF210A can help conserve time and supplies.', '886111334957', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(220, 219, 'Get two toner cartridges for a reduced cost when you purchase the HP CF280XD high capacity toner twin pack. The HP 80X Black dual pack contains two HP CF280X high capacity Black cartridges and is intended for businesses with high-volume printing needs.', 'Get two toner cartridges for a reduced cost when you purchase the HP CF280XD high capacity toner twin pack. The HP 80X Black dual pack contains two HP CF280X high capacity Black cartridges and is intended for businesses with high-volume printing needs. The HP CF280XD high capacity Black cartridge twin pack offers dark and solid texts and greyscale images. The HP CF280XD Black toner also blends well with other colours to deliver vibrant pictures. The HP 80X toner supplies offers a low cost-per-page ratio with each of the high yield cartridges capable of printing up to 6,900 pages in Black and white.', '886112379643', '0', 227, 344, 228, NULL, 'HP', '', 0, ''),
(221, 220, 'The genuine high capacity Black HP 301XL ink cartridge gives you even more original HP ink for your money. Printing up to 2.5 times as many pages as the standard HP cartridge, this high capacity Black HP301XL ink cartridge will print approximately 480 pages and brings you significant cost savings.', 'The genuine high capacity Black HP 301XL ink cartridge gives you even more original HP ink for your money. Printing up to 2.5 times as many pages as the standard HP cartridge, this high capacity Black HP301XL ink cartridge will print approximately 480 pages and brings you significant cost savings. Black ink often runs our quickly in a busy office but this high capacity Black HP 301XL cartridge is ideal for frequent use, allowing you to print crisp Black text and images at a low cost-per-page. Featuring HP\\''s advanced ink formula, this high capacity Black HP 301XL or HP CH563EE printer cartridge produces sharp text and laser-like print speeds. Constructed from robust HP parts, this reliable HPCH563EE cartridge contains pigment ink for durable prints that resist fading for decades. Cut the costs of producing your Black and white documents and buy your ink in this high capacity HP301XL cartridge.', '884962894439', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(222, 221, 'This HP 343 ink cartridge twin pack is ideal for volume users as it lowers the cost having a spare cartridge - It\\''s good to know you\\''ve always got a spare HP 343 cartridge in the drawer for when you need it. ', 'This HP 343 ink cartridge twin pack is ideal for volume users as it lowers the cost having a spare cartridge - It\\''s good to know you\\''ve always got a spare HP 343 cartridge in the drawer for when you need it. The HP343 ink cartridge provides rich, life-like colour for printing multi-colour documents, graphics and photos. Using Vivera inks the HP 343 cartridge prints professional quality, long-lasting images every time. The HP 343 Vivera ink uses an exclusive pigment based inks are specially formulated to produce a broad colour gamut, really rich Blacks and true neutral greys on a wide variety of media. HP 343 ink is designed to provide excellent colours and fine gradients within the colour boundaries for accurate, consistent colour.', '882780560468', '0', NULL, NULL, NULL, 127, 'HP', '', 0, ''),
(223, 222, 'The genuine Black HP CE260A toner cartridge is a high performance printer cartridge released by Hewlett Packard for use in your laser printer. ', 'The genuine Black HP CE260A toner cartridge is a high performance printer cartridge released by Hewlett Packard for use in your laser printer. This Black HP CE260A printer cartridge with improved Colorsphere toner formula brings you a range of advanced printing features including:\n\nSharper Black text and graphics with Colorsphere toner\nConsistent, uninterrupted printing perfect for office use\nHigh-volume cartridges minimise downtime and maximise productivity\nSmart Printing Technology makes automatic adjustments to optimize print quality\nEasy installation and effortless maintenance with toner tracking and low-toner alerts', '884420186816', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
