(234, 233, 'Sharp and crisp results can be produced all the time using the genuine Black HP C8550A toner cartridge. The formulation of the original HP C8550A Black toner is compatible with select HP speciality papers.', 'Sharp and crisp results can be produced all the time using the genuine Black HP C8550A toner cartridge. The formulation of the original HP C8550A Black toner is compatible with select HP speciality papers. The HP Smart printing system is supported by the HP C8550A toner for low-maintenance and easy operation. Meanwhile, the Black HP 822A toner provides uniform gloss levels on high-coverage documents. Users are automatically alerted when the HP C8550A Black cartridge has run out or is low on toner, so they can save time and order a replacement HP C8550A toner cartridge soon. Built with productivity in mind, this long-life HP 822A Black toner cartridge can produce up to 25,000 Black and white pages to give your office efficiency a significant boost.', '88698445327', '0', 142, 333, 198, 810, 'HP', '', 0, ''),
