(236, 235, 'The innovative design of this genuine HP C8563A Magenta imaging drum makes it a reliable all-in-one-product for ensuring continuous production of colour output in the small office.', 'The innovative design of this genuine HP C8563A Magenta imaging drum makes it a reliable all-in-one-product for ensuring continuous production of colour output in the small office. HP\\''s smart printing technology is part of the design of this HP C8563A image drum to guarantee accurate and vibrant colours with uniform coverage on every page. The HP C8563A Magenta drum unit is also known as a HP 822A Magenta imaging drum and can perform automatic adjustments for optimised print quality and minimal user intervention to save resources and time. Low-maintenance printing is also assured by this replacement HP C8563A image drum, and when the product is out or low, users are immediately alerted for fast and convenient re-ordering. The HP 822A Magenta LaserJet drum unit is compatible with a wider range of media types, and it produces uniform gloss for professional results. This original C8563A drum works reliably for up to 40,000 pages.\n\n', '88698445396', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
