(240, 239, 'Expect high-quality output when you use the HP C9720A Black toner. The HP C9720A toner cartridge offers dark and smooth ink to deliver crisp text documents and greyscale images. ', 'Expect high-quality output when you use the HP C9720A Black toner. The HP C9720A toner cartridge offers dark and smooth ink to deliver crisp text documents and greyscale images. The unique chemical formula found in this C9720A cartridge contains fine toner particles to guarantee precise ink transfer for accurate text and image reproduction. The HP C9720A toner can help lower running costs as it can deliver an estimated 9,000 pages before it needs to be replaced which would make this HP C9720A toner ideal for an office environment which requires large volumes of printing. The HP C9720A laser toner cartridge also offers low cost per page ratio without scrimping on the quality of prints so you can expect professional results every time you press print.', '88698394755', '0', 147, 390, 247, 1400, 'HP', '', 0, ''),
(241, 240, 'Save money and get more mileage for your printer by using the genuine high capacity Black HP 27X toner cartridge in your HP laser printer.', 'Save money and get more mileage for your printer by using the genuine high capacity Black HP 27X toner cartridge in your HP laser printer. This HP 27X high yield Black original LaserJet toner cartridge contains 65% more toner than the standard cartridge, so it lasts longer and delivers an estimated 20% saving on the cost-per-page. The genuine HP 27X toner contains dual polymer toner particles infused with magnetic seals and a helical roller drive to ensure the production of high quality output. The genuine HP C4127X high capacity Black cartridge is engineered with Ultraprecise technology for consistent and accurate results. Print up to 10,000 pages of crisp Black and white documents using this productive high capacity Hewlett Packard 27X Black toner cartridge.', '88698192771', '0', 353, 156, 247, 1600, 'HP', '', 0, ''),
(242, 241, 'The genuine Black HP 24A toner cartridge is formulated with an innovative solution and constructed with a sturdy design to ensure reliability and better productivity in the small office. ', 'The genuine Black HP 24A toner cartridge is formulated with an innovative solution and constructed with a sturdy design to ensure reliability and better productivity in the small office. The HP Q2624A Black toner cartridge ensures professional quality in text and graphics throughout the life of the cartridge. Engineered for perfection, the HP 24A Black LaserJet toner cartridge is fast and dependable from first print to last and aims to deliver immaculate results all the time. The HP Q2624A toner is an all-in-one cartridge that is easy to manage and maintain for hassle-free printing because the drum and toner are integrated which means fewer cartridges to replace.', '808736420617', '0', 333, 142, 198, 730, 'HP', '', 0, ''),
(243, 242, '', '', '829160664668', '0', NULL, NULL, NULL, 0, 'HP', '', 0, ''),
(244, 243, 'Helping you to create more prints at an affordable price, the HP Q2610A toner cartridge is an ideal cartridge which is essential to document production.', 'Helping you to create more prints at an affordable price, the HP Q2610A toner cartridge is an ideal cartridge which is essential to document production. Holding Black toner, the HP Q2610A toner cartridge is an integral part of the printing process and can be used for a wide range of documents, from school work to photographs. HP has manufactured the HP 10A toner cartridge according to strict rules and regulations, making the HP Q2610A toner cartridge a reliable and durable cartridge which will not fail or cause any internal printer damage. The HP Q2610A toner cartridge is specially designed to give you consistent results as well, ensuring that you\\''re able to produce quality prints well into the HP 10A toner cartridge\\''s life. Designed for average people, the HP Q2610A toner cartridge is easy to install and handle which ensures the HP Q2610A toner cartridge replacement process is over in a few quick steps, allowing you more time to print. Capable of producing up to 6,000 pages at 5% coverage, the HP 10A toner cartridge is an ideal cartridge which will ensure you\\''re always ready to print.', '808736396318', '0', 390, 190, 247, 1600, 'HP', '', 0, ''),
(245, 244, 'The HP Q2613A Black toner has an easy-to-use design and is capable of producing 2,500 pages per cartridge, making it ideal for busy print environments. It reduces downtime in between cartridges, thanks to its quick-install cartridge that easily slips into the printer\\''s HP 13A laser toner slot. ', 'The HP Q2613A Black toner has an easy-to-use design and is capable of producing 2,500 pages per cartridge, making it ideal for busy print environments. It reduces downtime in between cartridges, thanks to its quick-install cartridge that easily slips into the printer\\''s HP 13A laser toner slot. Unlike fake toners, this genuine Black Q2613A toner will ensure you get unrivalled ink quality no matter what the ink level is in the toner cartridge. The HP 13A toner unit is especially formulated to produce refined images and clear and sharp texts. If you want a toner which is capable of maintaining professional grade text and graphics throughout its usage, choose the Q2613A toner for your printer.\n\n', '808736420389', '0', 333, 142, 198, 1070, 'HP', '', 0, ''),
(246, 245, 'The HP 51A toner cartridge (HP Q7551A) is a Black cartridge which helps to create brilliant monochrome prints when partnered with your compatible LaserJet or MFP HP printer.', '', '882780389052', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(247, 246, 'Use the HP C9469A Yellow ink and receive high-quality images that will last thanks to exceptional fade resistance technology in every cartridge. ', 'Use the HP C9469A Yellow ink and receive high-quality images that will last thanks to exceptional fade resistance technology in every cartridge. The HP 91 ink cartridge offers rich ink that blends well with other colours to offer professional output that will amaze. Images are vibrant and texts are clear with the HP C9469A ink jet cartridge. Original printer products, like the HP 91 Yellow ink, are very easy to install and replace to ensure maximum ease of use. It can also help increase office productivity and keep your printer working smoothly and efficiently. With a genuine HP 91 product you can expect a high standard of print which would be ideal for an office environment where a professional finish is essential.', '882780987234', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(248, 247, 'Print more pictures and vibrant colour images with the genuine HP 91 3-pack 775-ml Cyan ink cartridges. Pigment-based ink is used in the HP 91 Cyan ink cartridges for a wider colour gamut and superior lightfastness, so pictures and display media can last longer, even when displayed or archived.', 'Print more pictures and vibrant colour images with the genuine HP 91 3-pack 775-ml Cyan ink cartridges. Pigment-based ink is used in the HP 91 Cyan ink cartridges for a wider colour gamut and superior lightfastness, so pictures and display media can last longer, even when displayed or archived. The pigments in each HP C9483A multipack ink cartridge can last in-window for 1+ years unlaminated, 3+ years laminated or 200+ years if kept away from direct sunlight. Ideal for producing photo-quality images, these 3 x Cyan HP 91 inks produce brilliant colour output and crisp lines. This genuine HP C9483A Cyan triple pack is compatible with easy management tools of the printer, so users will know when it\\''s time for a replacement. The Cyan HP 91 print cartridge 3-pack is compatible with more media types, including glossy sheets and recycled paper.', '883585034857', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(249, 248, 'Designed for budget-friendly printing, this genuine J3M83AE multipack gives you 4 high-capacity genuine HP 364XL inks, all offering impressive page yields.', 'Designed for budget-friendly printing, this genuine J3M83AE multipack gives you 4 high-capacity genuine HP 364XL inks, all offering impressive page yields. This genuine HP 364XL multipack includes a 550-page Black cartridge, along with 750-page colour cartridges, each dispensing a fine formulation of HP 364XL inks that allow rich, vibrant, and long-lasting print results. Ideal for budget-conscious users, this genuine HP 364XL ink pack pulls down print costs to an affordable pence per page.', '8887933068718', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(250, 249, 'HP 337 Black Inkjet Print Cartridge with Vivera Ink prints darker, laser-quality Black text that offers greater resistance to highlighter pen smear.', 'Black HP 337 ink cartridge (also know as HP C9364EE ink) with Vivera Ink prints darker, laser-quality Black text that offers greater resistance to highlighter pen smear. This Black HP 337 ink cartridge delivers enhanced durability and superior fade-resistance, so you can produce attention-grabbing charts and graphics and rich deep Blacks with HP\\''s exclusive Vivera Ink formulation. The innovative HP 337 cartridge design incorporates a wide 9/16 inch print swath enabling impressively fast print speeds.', '829160799049', '0', 36, 116, 115, 67, 'HP', '', 0, ''),
(251, 250, 'HP 350/351 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text.', 'HP has released the HP SD412EE twin pack in order to help you save time and money with one simple purchase. The HP SD412EE twin pack contains one Black HP 350 ink cartridge and one colour HP 351 ink cartridge which is everything you need for full colour printing.', '884420861508', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
(252, 251, 'Enduring, laser-quality text\nVersatile, economical 5-ink printing\nCount on HP for a superior printing experience', '', '883585705085', '0', 24, 107, 115, 50, 'HP', '', 0, ''),
(253, 252, 'HP 364XL Photo Ink Cartridge is designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. Does not work in printers with only 4 slots. ', 'HP 364XL Photo Ink Cartridge is designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. Does not work in printers with only 4 slots. The Photo ink cartridge will not fit in the Black cartridge slot. Designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. The HP 364XL Photo Ink Cartridge does not work in printers with only 4 slots. The Photo ink cartridge will not fit in the Black cartridge slot. Save more and get a better value - use optional high-capacity XL cartridges. With Original HP ink cartridges, you can print easily and affordably. These convenient individual ink cartridges can be replaced one at a time as needed. Get impressive results for all your photos, creative projects and everyday prints, using inks designed to meet all your printing needs. Print long-lasting, lab-quality photos and projects.', '883585705801', '0', 24, 107, 115, 50, 'HP', '', 0, ''),
(254, 253, 'HP 300 Tri-colour Ink Cartridges let you easily print vivid colour documents, reports and letters at an affordable price. This Original HP ink cartridge is designed to deliver user-friendly features and consistent, reliable performance.', 'The genuine Black & tri-colour HP 300 ink cartridge multipack allows you to buy your ink cartridges in a twin pack to save time and money. This original HP CN637EE ink cartridge twin pack contains 1 x Black HP 300 ink cartridge (CC640EE) and 1 x tri-colour HP 300 ink cartridge (CC643EE). HP 300 printer cartridges are specially formulated with long-lasting HP ink that resists fading and produces crisp text and colour quality that maintains its perfect image quality for many years to come. The Black HP 300 ink cartridge produces laser-like text characters to give your documents a professional touch. Meanwhile, printing vibrant, eye-catching graphics is even easier because the tri-colour HP 300 ink cartridge gives you a combination of Cyan, Magenta and Yellow inks in a single cartridge that you can easily install alongside your Black HP CC640EE cartridge. Pay less for your ink and buy your Black and colour cartridges together in the cost-effective HP CN637EE multipack.', '884962770160', '0', 38, 117, 170, 111, 'HP', '', 0, ''),
(255, 254, 'HP 21XL Black Inkjet Print Cartridges are designed to print in higher-volumes with fewer cartridge changes. Print more rich, laser-quality Black text and save money too. Ideal for printing laser-quality Black text for home use, home and small offices.', 'HP 21XL Black Inkjet Print Cartridges are designed to print in higher-volumes with fewer cartridge changes. Print more rich, laser-quality Black text and save money too. Ideal for printing laser-quality Black text for home use, home and small offices. High-capacity ink cartridge prints 2.5 times more printed pages with fewer cartridge changes while providing better cost per page for frequent printing customers. Count on Original HP ink cartridges for superior reliability and performance. Original HP ink cartridges are widely available and easy to select, replace, and install.', '884962780763', '0', 36, 113, 115, 47, 'HP', '', 0, ''),
(256, 255, 'HP 301 Black Ink Cartridges are designed to deliver user-friendly features and great value. Print documents with laser-quality Black text and sharp images that resist fading. Get user-friendly features and great value. ', 'The genuine Black HP 301 ink cartridge gives you outstanding print performance and unbeatable value. This user-friendly HP 301 printer cartridge is officially designed by Hewlett Packard, a market leader in terms of quality and innovation. Featuring HP\\''s advanced ink formula, the HP301 cartridge produces laser-like text that is ideal for printing professional quality office documents including reports, newsletters and web prints. Also known as the HP CH561EE ink cartridge, this original HP supply contains pigment-based ink to give your prints extra durability and ensures that your documents resist fading for decades. The Black HPCH561EE ink cartridge is the next big thing in HP printing and is the result of many years of innovation and design.', '884962894385', '0', 37, 113, 115, 50, 'HP', '', 0, ''),
(257, 256, 'HP 301 Tri-colour Ink Cartridges are designed to deliver user-friendly features, including technology that lets you finish printing a critical job even when youre low on a specific ink. Easily print vivid colour documents, reports and letters.', 'The genuine tri-colour HP 301 ink cartridge is designed to print eye-catching graphics that will bring your pages to life. Containing original HP ink, this tri-colour HP 301 printer cartridge is also known as the HP CH562EE ink cartridge and uses specially formulated dye-based ink to bring you superb colour vibrancy. The tri-colour HP301 cartridge contains Cyan, Magenta and Yellow inks within a single, compact cartridge. Easy to use and replace, this convenient tri-colour HP CH562EE inkjet cartridge produces vivid colours and sharp images that resist fading for decades. When used in-conjunction with ColorLok papers, this tri-colour HP 301 ink will deliver enhanced image quality with richer, brighter graphics as well as faster drying times that result in reduced smearing. With an estimated capacity of 165 pages, the tri-colour HP No.301 cartridge offers an inexpensive solution for printing in vibrant colours.', '884962894484', '0', 37, 113, 115, 60, 'HP', '', 0, ''),
(258, 257, 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text.', 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text. Ideal for families and personal users producing a large-volume of everyday prints. Perfect for greeting cards, letters, e-mail, photos and graphics. Get results you can count on across a broad range of plain papers and speciality media. Save money with economical and convenient HP Combo-pack Inkjet Print Cartridges. Contains one Black and one tri-colour Inkjet print cartridge to meet your everyday printing needs, and costs less than two individual cartridges bought separately. HP 21 and 22 Inkjet Print Cartridges produce professional-looking documents and true-to-life, colour-accurate photos. Print crisp, laser-quality text for your letters and reports, and brilliant, long-lasting colour photographs and graphics.', '883585651719', '0', 38, 117, 170, 123, 'HP', '', 0, ''),
(259, 258, 'Featuring Epson\\''s DURABrite Ultra ink formula, these Epson T0711 ink cartridges are perfect for printing beautiful, durable results on all types of paper with rich Blacks and crisp quality.', 'Featuring Epson\\''s DURABrite Ultra ink formula, these Epson T0711 ink cartridges are perfect for printing beautiful, durable results on all types of paper with rich Blacks and crisp quality. The T0711 can also be bought as part of the Epson T0715 multi-pack offering a further saving. Designed to work with a range of Epson printers, the Epson T0711 cartridge (also known by its part number of C13T07114010 and easily spotted by the cheetah picture on the front of the pack) provides superior fade, smudge and water resistance.', '8715946495439', '0', 30, 112, 142, 50, 'EPSON', '', 0, ''),
(260, 259, 'Ideal for everyday printing, Epson DURABrite Ultra Ink is perfect for printing high-quality documents and lab-quality photos, thanks to the unique pigment-based ink technology encapsulates ink particles in a protective resin coating.', 'Featuring Epson\\''s DURABrite Ultra ink formula, these Epson T0711 ink cartridges are perfect for printing beautiful, durable results on all types of paper with rich Blacks and crisp quality. The T0711 can also be bought as part of the Epson T0715 multi-pack offering a further saving. Designed to work with a range of Epson printers, the Epson T0711 cartridge (also known by its part number of C13T07114010 and easily spotted by the cheetah picture on the front of the pack) provides superior fade, smudge and water resistance. Buy your Epson T0711 printer cartridges today!', '8715946384825', '0', 112, 30, 142, 50, 'EPSON', '', 0, ''),
(261, 260, 'The genuine high capacity Black Epson C13T12914011 ink cartridge gives you more Epson DURABRrite Ultra Ink for your money and allows you to print with maximum cost-efficiency.', 'The genuine high capacity Black Epson C13T12914010 ink cartridge gives you more Epson DURABRrite Ultra Ink for your money and allows you to print with maximum cost-efficiency. This high capacity Black Epson T1291 ink cartridge prints perfectly formed Black text and sharp images onto a range of paper types. Siutable for use on plain, glossy or matte type papers, this versatile Epson C13T129140 ink is smudge-proof, water-resistant and lightfast, making Epson T1291 ink the perfect solution for creating durable prints and archival documents. Containing resin-caoted pigment ink, the Black Epson T1291 ink cartridge gives you laser-like text reproduction and comes in a high capacity cartridge to deliver a low cost-per-page output. Constructed from official Epson parts, this original Black Epson T1291 cartridge comes in an independent ink tank to maximise cartridge life and bring you better value.', '8715946494500', '0', NULL, NULL, NULL, NULL, 'EPSON', '', 0, ''),
(262, 261, 'Ideal for small-business and home-office customers who print frequently, who want to reliably produce professional documents with laser-quality text for less and who care about recycling and resource conservation. Ensure dependable, high-quality results with every print. Use HP Officejet inks and impressive reliability features for worry-free consistency, page after page.', '', '887111884923', '0', 65, 138, 17, 193, 'HP', '', 0, ''),
(263, 262, 'Print professional-quality colour page after page. Bring documents and marketing materials to life with outstanding colour vibrancy for a low cost per page, and easily recycle your cartridges. Ensure dependable, high-quality results with every print. Use HP Officejet inks and impressive reliability features for worry-free consistency page after page.', 'A genuine high capacity Cyan HP 933XL ink cartridge is an ideal solution for larger offices looking for a way to save money, increase productivity, and lower their printing costs. The 933XL cartridge from Hewlett Packard promises professional quality output with Cyan coloured prints that leap off the page, so documents and graphics are brought to life with vibrant blues and greens, while still maintaining a lower cost-per-page thanks to the cartridge\\''s high capacity. You can bring out the best from your HP inkjet printer using this original HP 933XL Cyan ink in conjunction with ColorLok speciality paper, but you can enjoy the same fade and smudge-proof qualities when printing on plain paper.', '886111749027', '0', 126, 94, 25, 40, 'HP', '', 0, ''),
(264, 263, 'Whether creating web pages, office documents or school projects, Epson DURABrite Ink is ideal. And as it is resistant to both water and smudging, it\\''s the perfect ink for printing glossy, lab-quality photos.', '', '8715946507224', '0', NULL, NULL, NULL, NULL, 'EPSON', '', 0, ''),
(265, 264, 'HP 338/343 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text.', 'The genuine Black HP 338 & tri-colour HP 343 ink cartridge multipack offers you a cheaper and easier way to buy your HP ink cartridges. This economical HP SD449EE twin pack contains 1 x back HP 338 ink cartridge (C8765EE) and 1 x tri-colour HP 343 ink cartridge (C8766EE) for full colour printing. Designed to print long-lasting, photos, text and graphics, the HP338 and HP343 ink cartridges can now be purchased together to cut the cost of buying individual cartridges. The Black HP 338 cartridge contains pigment ink for printing laser-quality text that is suitable for important office documents such as letters or reports. Meanwhile, the tri-colour HP343 cartridge contains dye-based inks in Cyan, Magenta and Yellow colours and is used to produce eye-catching graphics or photo prints with vivid colours and true-to-life image quality', '884962520246', '0', 38, 117, 170, 126, 'HP', '', 0, ''),
(266, 265, 'HP 951XL Officejet Value Pack prints impressive text and graphics, using Original HP media and HP Officejet inks. Produce affordable, long-lasting professional-quality flyers and office documents at your home or office. Save on ink and paper when you buy them together in one affordable set.', 'Get great value for money with the HP CR712AE 3 colour multipack with A4 photo paper. The HP CR712AE photo pack consists of three high capacity Cyan, Magenta, and Yellow ink cartridges plus 75 sheets of A4 paper. You can produce high quality images with vibrant colours using this original HP CR712AE photo pack which gives you everything you need for colour printing. Your HP printer will run smoothly with the Hewlett Packard CR712AE ink cartridges installed and genuine HP photo paper to print on. The cartridges within this 3 colour CR712AE pack are also known as high capacity HP 951XL ink cartridges.', '886111754267', '0', 34, 222, 310, 890, 'HP', '', 0, ''),
(267, 266, 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance.', 'Making sure that you can print at a moment\\''s notice, the HP Q7551XD toner cartridge twin pack supplies you with two HP 51XD toner cartridges in order to allow you to save time and money. Constructed originally by HP, the HP Q7551XD toner cartridge twin pack is put together carefully and with attention to detail in order to make sure that the HP Q7551XD toner cartridge twin pack gives you plenty of results with minimal fuss. Made with the average user in mind, the HP 51XD toner cartridge is highly useful as it is a Black toner cartridge, thus meaning that the HP 51XD toner cartridge can be used in the majority of prints. Capable of producing up to 13,000 pages at 5% coverage each, the HP 51X toner cartridges included in the HP Q7551XD toner cartridge twin pack will make sure your prints have a professional quality that you can be proud of without costing too much money. The HP Q7551XD toner cartridge twin pack is ideal for a busy printing environment because the HP Q7551XD toner cartridge twin pack supplies you with two toner cartridges, thus eliminating the need to constantly reorder new HP 51X toner cartridges when you\\''re done with them.', '883585945009', '0', 331, 392, 329, 320, 'HP', '', 0, ''),
(268, 267, 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance.', 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance. Accurate colour, precise image reproduction and crisp, sharp text every time you print. Chemically-grown toner and HP Smart printing system technology deliver consistent results and reliable performance throughout the life of the cartridge. HP Smart technology makes automatic adjustments to optimize print quality and enhance reliability. Minimal user intervention saves time, improves productivity and lowers overall printing costs. Enjoy low maintenance, trouble-free printing. HP Smart technology in the toner cartridge and your printer makes HP supplies easy to install and maintain. Receive automatic alerts when a cartridge is low or out.', '882780984905', '0', 397, 395, 332, 630, 'HP', '', 0, ''),
(269, 268, 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance. Accurate colour, precise image reproduction and crisp, sharp text every time you print. Chemically-grown toner and HP Smart printing system technology deliver consistent results and reliable performance throughout the life of the cartridge.', 'The genuine high capacity Black HP 90X toner twin pack, also known as the HP CE390XD Black dual pack, is a solution for a small to medium-sized office that needs an economical way to reduce the cost-per-page ratio. The HP 90X multipack contains two high capacity Black HP CE390X toners and offers better value for money than individual cartridges. The CE390XD dual pack can also save time and improve productivity without compromising professional-quality results. Users can also reduce their time shopping for replacement cartridges because a pack allows you to keep a spare HP 90X toner on hand for when you run out. With the 90X high capacity toner pack, it is possible to enjoy crisper and sharper output at an extended period. These genuine high capacity Black HP 90X toner supplies are also part of the free recycling programme, HP Planet Partners.', '5053839252664', '0', 390, 400, 332, 50, 'HP', '', 0, ''),
(270, 269, 'Kodak\\''s proprietary pigment-based ink technology provides the vibrancy of dye-based inks, but the durability of pigment-based inks so you get sharp text, brilliant colour documents and photos that dry instantly, are water resistant and last a lifetime. All from the only company that offers you the lowest total ink replacement cost.', 'The genuine Black Kodak 30 ink cartridge is the official replacement Black ink cartridge for your Kodak printer. Featuring superior quality Kodak ink, this original Black Kodak No.30 printer ink delivers sharp, clear text and images. Kodak\\''s proprietary pigment-based ink, contained within every Kodak No.30 cartridge, ensures that your documents are durable, long-lasting and professional. The fast drying formula of Kodak 30B ink offers enhanced protection against smudging and smearing, taking the hassle out of inkjet printing.', '41773952332', '0', NULL, NULL, NULL, NULL, 'Kodak', '', 0, ''),
(271, 270, 'The genuine high capacity Black Kodak 30XL ink cartridge allows you to print for longer in crisp Black ink. Giving you twice as much ink as the Kodak 30 cartridge, this original high capacity Black Kodak 30XL printer cartridge saves you money without compromising the quality of your documents.', 'The genuine high capacity Black Kodak 30XL ink cartridge allows you to print for longer in crisp Black ink. Giving you twice as much ink as the Kodak 30 cartridge, this original high capacity Black Kodak 30XL printer cartridge saves you money without compromising the quality of your documents. Featuring specially formulated pigment ink, this high capacity Black Kodak No.30XL ink cartridge produces high quality output that is both water and fade resistant, drying instantly on your page to prevent smudging. Easy to install or replace, this high capacity Black Kodak 30XL inkjet cartridge is the ideal solution for printing professional quality office documents at a low cost-per-page. Print up to 670 pages from this high capacity Kodak N30XL cartridge and get finely detailed text and images from start to finish.', '41773952363', '0', NULL, NULL, NULL, NULL, 'Kodak', '', 0, ''),
(272, 271, 'Colour pages can be more vibrant with the genuine Lexmark 15 tri-colour return program ink cartridge.', 'Colour pages can be more vibrant with the genuine Lexmark 15 tri-colour return program ink cartridge. Suitable for small offices and home users, the Lexmark 018C2110E tri-colour ink is formulated for high quality photos and better graphics without compromising the speed and performance of the printer. The Lexmark 15 ink cartridge is resilient and easy to install, and when it runs out of ink, users can return it to Lexmark so it can be re-manufactured or recycled. The Lexmark 15 ink cartridge includes the colours Cyan, Yellow, and Magenta, and each can mix well with one another to create a wide variety of colours to ensure accurate output. The Lexmark 018C2110E ink is compatible with a wide range of media types', '734646964630', '0', NULL, NULL, NULL, NULL, 'Lexmark', '', 0, ''),
(273, 272, 'This high-resolution Black cartridge uses Lexmark\\''s exclusive pigmented Black ink. This ink coupled with an increased number of printhead nozzles and swath size, enables consumers to consistently produce high-quality prints at unprecedented print speeds. This cartridge contains redundant nozzles, which help ensure consistent print quality.', 'High resolution monochrome graphics and text documents can be more presentable when the genuine Lexmark 14 Black return program ink cartridge is used. The Lexmark 14 ink cartridge is engineered for resiliency and versatility, so it is compatible with a wide range of paper types and speciality media. The cartridge of the Lexmark 018C2090E Black ink is an all-in-one product with redundant nozzles that guarantee consistency on every page, so if one nozzle fails or gets clogged, the other continues to work.', '734646964586', '0', NULL, NULL, NULL, NULL, 'Lexmark', '', 0, ''),
(274, 273, 'This high-resolution Black cartridge uses Lexmark\\''s exclusive pigmented Black ink. This ink coupled with an increased number of printhead nozzles and swath size, enables consumers to consistently produce high-qualityprints at unprecedented print speeds.', 'Get professional documents consistently with the Lexmark 18C1523E Black ink. The Lexmark 23 ink is designed to deliver fade-resistant output with the pigmented ink supplied in these cartridges. Texts are sure to be clear when you use the Lexmark 23 Black ink. The Lexmark 23 ink cartridge can also be used for delivering high-quality images. Opt for the Black Lexmark 18C1523E ink, it can help increase productivity while lowering running costs. The Black Lexmark 23 ink has an average page yield of 215 pages. The Lexmark 23 will effortlessly fit into your compatible printer.', '734646961325', '0', NULL, NULL, NULL, NULL, 'Lexmark', '', 0, '');
