(275, 274, 'Use Lexmark Genuine ink and paper for best results! A variable amount of ink remains when this cartridge must be replaced. This is a non-refillable cartridge licensed for single use only. Return empty cartridge only to Lexmark for remanufacturing, refilling or recycling.', 'Pigments used in the genuine Lexmark no.23 Black / no.24 tri-colour multipack return program ink cartridge ensure high quality results with improved archivability. Users can produce vibrant colour photographs and graphics as well as sharp monochrome documents that can be stored or displayed. The Lexmark 18C1419E multipack comes with two ink cartridges for more savings. A wider range of media is compatible with the Lexmark 23 & 24 ink cartridges.', '734646962612', '0', NULL, NULL, NULL, NULL, 'Lexmark', '', 0, ''),
(276, 275, 'The Lexmark 43XL colour print cartridge contains evercolour2 ink; its unique pigment based formulation combines exceptional resilience with improved archivability', 'Print more colourful photographs and full-colour documents using the genuine Lexmark 43XL colour ink cartridge. The genuine Lexmark 18Y0143E tri-colour ink creates high quality and consistent results on plain paper and select speciality media because of the unique pigment-based Evercolor 2 ink formulation. Superior water resistance and exceptional lightfastness are added qualities to the printouts that are produced using the genuine Lexmark 43XL ink jet cartridge. The ink tank contains more genuine Lexmark 18Y0143E cartridge ink, so it lasts up to 500 pages and eliminates the need for a replacement soon', '734646964517', '0', 38, 70, 98, 60, 'Lexmark', '', 0, ''),
(277, 276, 'Individual ink cartridges allow for more control over the ink you use- replace only the colour you need. Print brilliant photos with precise, consistent drop placement. Vizix print technology delivers vibrant, crisp prints from the first print to the last. When compared on a composite yield basis with Lexmark 100 Cyan, Magenta and Yellow Ink Cartridges.', 'The genuine high capacity Cyan return program Lexmark 100XL ink cartridge has been released by Lexmark to bring you state-of-the-art inkjet printing. Featuring Lexmark\\''s new patented Vizix print technology this superb high capacity Cyan Lexmark 100 XL printer cartridge is alternatively known as Lexmark 14N1069E ink. Designed as an individual colour cartridge this high capacity Cyan return program Lexmark 14N1069E ink cartridge is extremely economical giving you more control over the ink you use and ensuring that you only replace a specific colour when it runs out. This Vizex ink cartridge prints bright and vivid colours that will visually enhance the appearance of your documents. Stunning photo-quality output is achieved by precise ink-droplet placement that dramatically increases the levels of detail seen in your images. The high capacity Cyan return program Lexmark 100XL ink cartridge works with unprecedented speed and accuracy that sets new boundaries for inkjet cartridges.', '734646967136', '0', 28, 98, 140, 40, 'Lexmark', '', 0, ''),
(278, 277, 'Individual ink cartridges allow for more control over the ink you use- replace only the colour you need. Print brilliant photos with precise, consistent drop placement. Vizix print technology delivers vibrant, crisp prints from the first print to the last. ', 'The genuine high capacity Yellow return program Lexmark 100XL ink cartridge is a high performance cartridge containing Lexmark\\''s revolutionary Vizix ink. Vizix print technology sets new boundaries for inkjet printing by offering you cutting-edge performance at a remarkably low cost. This high capacity Yellow Lexmark 100 XL ink uses consistent ink-droplet placement for exceptional colour accuracy. The independent ink tank design of the high capacity Yellow Lexmark 100 XL cartridge makes printer maintenance effortless and reduces waste because you only replace a specific colour when it runs out. This cartridge is also known as Lexmark 14N0171E ink and is a return program cartridge that is kind on both your budget and the environment. This return program Lexmark 14N0171E cartridge brings professional quality printing to the everyday home or office user and allows you to produce eye-catching graphics and lab-quality photos with true-to-life image quality. Better still, the high capacity return program Lexmark 100 XL cartridge contains three times as many pages as the standard Lexmark cartridge and features an estimated capacity of 600 pages', '734646967174', '0', 28, 98, 140, 40, 'Lexmark', '', 0, ''),
(279, 278, '', '', '734646539876', '0', 32, 455, 193, 50, 'Lexmark', '', 0, ''),
