(289, 288, 'The genuine high capacity Black Canon PG-540XL ink cartridge allows you to make great savings without experiencing any drop in print quality. This high capacity Black Canon PG-540XL printer cartridge contains pigment ink for crisp, durable prints that are long-lasting. ', 'The genuine high capacity Black Canon PG-540XL ink cartridge allows you to make great savings without experiencing any drop in print quality. This high capacity Black Canon PG-540XL printer cartridge contains pigment ink for crisp, durable prints that are long-lasting. Ideal for printing text documents or sharp Black images, this high capacity Black Canon PG540XL cartridge gives you plenty of ink for lots of high quality prints. Canon FINE cartridges such as this high capacity Black Canon PG-540XL ink cartridge are a combined ink tank and print head that work together in a more convenient printing system. With an estimated capacity of 600 pages, this high capacity Black Canon 5222B005AA ink cartrdge gives you a cheaper cost-per-page than the standard ink tank.', '8714574572550', '0', NULL, NULL, NULL, 600, 'Canon', '', 0, ''),
(290, 289, 'Get the genuine Epson 18 Black ink to improve your printing output. The Epson C13T18014010 ink cartridge offers up to 175 pages and can deliver top notch prints.', 'Get the genuine Epson 18 Black ink to improve your printing output. The Epson C13T18014010 ink cartridge offers up to 175 pages and can deliver top notch prints. It can be used for printing documents or even images and graphics. The all-around Epson 18 Black ink cartridge is great for home or office use. The game-changing Claria Ink technology, which offers hi-definition output, is used in the Epson T0801 Black inkjet cartridge. The Epson C13T18014010 ink looks great on a wide range of media, from plain to glossy photo paper.\n\n', '8715946517926', '0', NULL, NULL, NULL, 175, 'Epson', '', 0, ''),
(291, 290, 'Get the value you expect from cartridges specially designed to work with your HP printer for projects at home, work and school. Bring home reliable performance for practically any project. ', 'Original HP Ink Cartridges are specially designed to work with your printer to consistently deliver standout results - throughout the life of your cartridge. Make an impact - get laser-quality documents with crisp text. Experience printing the way you expect - and avoid wasting money. Original HP Ink Cartridges deliver pages you can use without worrying about performance. Make replenishing your Original HP Ink Cartridges quick and effortless.', '5054484717065', '0', 113, 37, 115, NULL, 'HP', '', 0, ''),
(292, 291, 'The HP no. 28 tri-colour inkjet print cartridge features patented dye-based inks formulated to produce brilliant, longer lasting photo-quality output every time.', 'The HP no. 28 tri-colour inkjet print cartridge features patented dye-based inks formulated to produce brilliant, longer lasting photo-quality output every time. HP supplies and printers are designed to work together as a printing system to ensure consistently outstanding results on a wide range of papers. This print cartridge generates very fine 5 picoliter drops that produce brilliant photo-quality images. Easy to replace, the HP no. 28 inkjet print cartridge is engineered with your HP printing system to provide special features such as on-screen ink-level indicators designed to save time and money.', '808736161107', '0', 112, 140, 35, 50, 'HP', '', 0, ''),
(293, 292, 'The HP 21 Black Inkjet Print Cartridge combines patented ink formulations with advanced inkjet print cartridge technology to ensure crisp, laser-quality Black text every time you print. Pigmented Black inks provide crisp sharp text for your letters and reports-documents you can be proud of from your HP printer.', 'The genuine Black HP 21 ink cartridge is an affordable and reliable product for printing sharp and crisp text documents, as well as monochrome graphics with the most distinctive detail. The pigmented formulation of the HP C9351A Black ink allows it to adhere easily to plain paper, so bleeding and smudging is minimised and outputs last for year without fading. The HP 21 ink cartridge can be used for printing on different speciality paper like glossy sheets and special media for flexibility in the ways you can display your printing outputs.', '829160808017', '0', 131, 141, 37, 40, 'HP', '', 0, ''),
(294, 293, 'HP 336 Black Inkjet Print Cartridge with Vivera Ink prints darker, laser-quality Black text that offers greater resistance to highlighter pen smear. This Black ink delivers enhanced durability and superior fade-resistant.', 'HP 336 Black Inkjet Print Cartridge with Vivera Ink prints darker, laser-quality Black text that offers greater resistance to highlighter pen smear. This Black ink delivers enhanced durability and superior fade-resistant. Get consistently dark, laser-quality text for professional printing on all your documents. Enjoy bold, rich output when you choose a Black pigment ink - ideal for making a strong impression. Mark your documents with a highlighter pen - this enhanced Black ink offers greater resistance to highlighter pen smear. Superior fade resistance lets you archive documents and important papers for decades. Count on HP for a superior printing experience - you\\''ll get legendary HP reliability and consistent performance. Get the best value when you select from print cartridges tailored to meet your printing needs.', '829160798936', '0', 36, 116, 115, 30, 'HP', '', 0, ''),
(295, 294, '', 'Print affordable, high-quality Black documents, using HP Officejet ink. HP Officejet ink consistently delivers laser-quality Black text that resists fading. This Original HP cartridge delivers user-friendly features including technology that lets you finish printing a critical job even when you\\''re low on a specific ink. Count on HP Officejet ink cartridges for consistent, reliable performance.', '883585763832', '0', NULL, NULL, NULL, 4, 'HP', '', 0, ''),
