(297, 296, 'Expect crisp documents when you use the original Black HP 970 ink cartridge. The HP 970 Black ink cartridge offers dark ink that is perfect for delivering sharp texts and smooth greyscale images. ', 'Expect crisp documents when you use the original Black HP 970 ink cartridge. The HP 970 Black ink cartridge offers dark ink that is perfect for delivering sharp texts and smooth greyscale images. This genuine and high quality Black HP 970 pigment ink can print up to 3,000 pages before it needs to be replaced. Specifically designed to bring out the best from your inkjet printer, the Black HP CN621AE ink cartridge offers fast drying, long-lasting and water resistant output for Black and white prints. Have a trouble-free printing experience and get optimum print quality and performance from this Black HP 970 pigment ink cartridge.', '886112877286', '0', NULL, NULL, NULL, NULL, 'HP', '', 0, ''),
