(1, 1, 'Ideal for everyday printing, Epson DURABrite Ultra Ink is perfect for printing high-quality documents and lab-quality photos, thanks to the unique pigment-based ink technology encapsulates ink particles in a protective resin coating.', 'This genuine Black Epson T0801 ink cartridge features Claria Photographic Ink and is part of the Hummingbird series of Epson inks. This means more mileage for your printer and longer lasting print outs because of the dye-based ink formulation. The tank is durable and well-made, with Epson\\''s innovative Claria ink system, so your print outs can last for up to 200 years. Print text in high resolution while enjoying ample gloss when using speciality paper. The Epson C13T08014010 inkjet cartridge is also great for high-definition Black-and-white photographs with superb clarity, depth, and richness without fading.', NULL, '', NULL, NULL, NULL, NULL, 'Epson', '1', '', 0, 'Bundle', 'S-C13T08014011'),
(2, 2, 'The genuine Black & colour Kodak 394074 ink cartridge twin pack lets you buy your Kodak No. 10 ink cartridges together to save time and money on replacements. This cost-effective Kodak 3947074 multipack contains 1 x Black Kodak 3947058 ink cartridge and 1 x 5 colour Kodak 3947066 ink cartridge. The Black & colour Kodak No. 10 ink cartridges work in a 6-ink system to deliver beautiful, lab-quality photo output. Premium pigment ink is used in the 5 colour Kodak 3947066 cartridge for printing vibrant, long-lasting photos.', 'HP Photosmart, HP Photosmart estation, HP Photosmart Premium, HP Photosmart Premium Fax', NULL, '', NULL, NULL, NULL, NULL, 'Kodak', '1,2,3,4', '', 0, 'Bundle', 'S-3947074'),
