(4, 4, 'HP 364XL Black Ink Cartridge prints crisp, laser-quality text. Rely on HP for superior quality printing and easy ways to recycle ink cartridges. Produce water-, smudge- and fade-resistant prints, using individual inks and HP Advanced Photo Paper.', 'The genuine high capacity Black HP CN684EE ink cartridge is the ideal solution for saving money. Designed to print more than twice as many pages as a standard HP 364 cartridge, this high capacity HP 364XL ink cartridge maximises your productivity and minimises your cost-per-page ratio. Filled with original HP ink for superior print quality, this high capacity Black Hewlett Packard CN684EE printer cartridge produces rich Blacks for improved contrasts and sharper, clearer text. Additional features of HP CN684EE ink are its water, smudge and fade resistant formula that allows you to print durable office documents without worrying about quality constraints. Previously known as HP CB321EE ink, the high capacity Black HP 364XL cartridge has the new part number HP CN684EE and now comes with a capacity of approximately 550 pages.', NULL, '', 23, 106, 115, 60, 'HP', '1', '', 0, 'Bundle', 'S-CN684EE'),
(5, 5, 'HP 364 Photo Ink Cartridge is designed for use only in HP printers with 5 cartridge slots: Black, photo, Cyan, Magenta, Yellow. Does not work in printers with only 4 slots. The Photo ink cartridge will not fit in the Black cartridge slot. Print long-lasting, lab-quality photos. Get impressive results for all your photos, creative projects and everyday prints. Handle your photos right from the printer, using Original HP inks with HP Advanced Photo Paper. Get impressive results for all your photos, creative projects and everyday prints, using inks designed to meet all your printing needs. Print long-lasting, lab-quality photos with rich Blacks and smooth greys. Print easily and affordably with cartridges that have a user-friendly design.', 'The genuine photo Black HP 364 ink cartridge is made with Vivera formulation for high quality output with stunning detail. Lines and the finest details can be distinctive when the HP CB317EE photo Black ink is used. Output can be archived or displayed without fading because of improved lightfastness in the HP 364 ink unit. Exceptional purity in the HP 364 ink cartridge ensures solid fills and better quality pictures that won\\''t smudge. The HP CB317EE photo Black ink is compatible with different types of speciality media to ensure you can be creative with your printing output. Order a HP 364 printer cartridge today for low cost per page printing without scrimping on print quality.', NULL, '', 107, 24, 115, 30, 'HP', '1', '', 0, 'Bundle', 'S-CB317EE'),
