(80, 80, '', 'The HP 83 UV Ink Cartridges are part of a modular ink system that delivers fast printing automatically. The HP 83 UV Colour ink system and newly formulated pigment-based inks offer the smoothest Colour transitions offered by HP large-format printers. \\"Smart chips\\" embedded in each of the HP 83 UV ink cartridges and printheads monitor ink usage, track printhead wear, and alert you when it\\''s time to replace your supplies. HP 83 ink supplies are HP-engineered and tested to work precisely with HP Designjet 5000 series printers and compatible HP printing material to deliver the professional results you expect.\n\nFeatures\nHP\\''s Jetexpress technology helps achieve unmatched speeds - up to 52.8 square meters per hour (printing 600 dpi, maximum speed mode, on HP Coated Paper).\nHP No. 83 pigment-based inks are newly formulated to deliver the most brilliant, photo-realistic images and vivid, full-color graphics that are lightfast and durable - indoors and outside.\nIdeal for outdoor or durable indoor prints, such as posters, banners, window displays.\n32 MB Flash Memory', '25184252755', '', 320, 114, 56, 950, 'HP', '2', '', 0, 'Single', 'S-C4941A'),
