(82, 82, 'The HP C9731A toner cartridge is a Cyan cartridge which has been engineered to work seamlessly with your HP printer to produce high-resolution documents. Designed for busy colour printing environments - the HP C9731A Cyan toner cartridge can handle large print workloads competently. And thanks to the laser-precision and accuracy of the Cyan HP C9731A printer cartridge, the need for reprints is minimised and workflow is improved. Boasting an impressive page capacity and a low cost-per-print ratio, the HP 645A Cyan toner can help you save money on your printing costs.', 'Get the best results out of your HP printing system. HP Smart technology* and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance. Accurate colour, precise image reproduction and crisp, sharp text every time you print. Chemically-grown toner and HP Smart printing system technology deliver consistent results and reliable performance throughout the life of the cartridge. Save time with all-in-one HP 645A LaserJet supplies. HP Smart technology makes automatic adjustments to optimize print quality and enhance reliability. Minimal user intervention saves time, improves productivity and lowers overall printing costs. Enjoy low maintenance, trouble-free printing. HP Smart technology in the toner cartridge and your printer makes HP supplies easy to install and maintain. Receive automatic alerts when a cartridge is low or out. Enjoy convenient, on-line ordering.\n\nFeatures\nHP Original Laser Toner Cartridge\nConsistently outstanding print quality\nEasy to install and to maintain\nReliable performance\nPrints up to 12,000 pages at approximately 5 percent coverage', '88698445419', '', 500, 260, 160, 2300, 'HP', '2', '', 0, 'Single', 'S-C9731A'),
