(211, 210, 'With the genuine Black HP (previously Hewlett Packard) 35A toner cartridge twin pack, you can reduce downtime, get greater value for their money and save in the long run.', 'With the genuine Black HP (previously Hewlett Packard) 35A toner cartridge twin pack, you can reduce downtime, get greater value for their money and save in the long run. The HP 35A Black toner twin pack contains two toner cartridges, making running costs cheaper than if you had to buy one HP CB435AD toner cartridge at a time. It saves time, too; once an HP CB435AD toner cartridge runs out, there is an immediate replacement, allowing you time to re-stock. The HP 35A twin pack guarantees sharper greyscale images and the crispest, most solid, Black text. The HP CB-435-AD toner cartridge is also engineered to keep the inside of the printer clean so maintenance becomes easier.', '884962022351', '', 370, 226, 113, NULL, 'HP', '1', '', 0, 'Single', 'S-CB435AD'),
(212, 211, 'Save money and print more high quality pages with the genuine HP CF373AM 3 colour toner cartridge multipack. This original HP CF373AM toner pack features the Cyan HP CB541A toner, the Magenta HP CB543A toner and the Yellow HP CB542A toner for your colour laser printer. ', 'Save money and print more high quality pages with the genuine HP CF373AM 3 colour toner cartridge multipack. This original HP CF373AM toner pack features the Cyan HP CB541A toner, the Magenta HP CB543A toner and the Yellow HP CB542A toner for your colour laser printer. Made from genuine HP parts, each toner in this HP 125A CMY multipack is a reliable product that promotes trouble-free and seamless printing of pictures, documents, and marketing materials in SOHO environments. The HP CF373AM toners can print up to 1,400 pages each and feature ColorSphere technology so they can produce a wider colour gamut for more accurate, vibrant, and consistent hues. It can also be simpler and faster to produce photo-quality output with the 3 colour CF373AM multipack with Smart Technology integrated into the cartridges.', '887111403025', '', NULL, NULL, NULL, NULL, 'HP', '2,4,3', '', 0, 'Single', 'S-CF373AM'),
