(222, 221, 'This HP 343 ink cartridge twin pack is ideal for volume users as it lowers the cost having a spare cartridge - It\\''s good to know you\\''ve always got a spare HP 343 cartridge in the drawer for when you need it. ', 'This HP 343 ink cartridge twin pack is ideal for volume users as it lowers the cost having a spare cartridge - It\\''s good to know you\\''ve always got a spare HP 343 cartridge in the drawer for when you need it. The HP343 ink cartridge provides rich, life-like colour for printing multi-colour documents, graphics and photos. Using Vivera inks the HP 343 cartridge prints professional quality, long-lasting images every time. The HP 343 Vivera ink uses an exclusive pigment based inks are specially formulated to produce a broad colour gamut, really rich Blacks and true neutral greys on a wide variety of media. HP 343 ink is designed to provide excellent colours and fine gradients within the colour boundaries for accurate, consistent colour.', '882780560468', '', NULL, NULL, NULL, 127, 'HP', '2,3,4', '', 0, 'Single', 'S-CB332EE'),
