(242, 241, 'The genuine Black HP 24A toner cartridge is formulated with an innovative solution and constructed with a sturdy design to ensure reliability and better productivity in the small office. ', 'The genuine Black HP 24A toner cartridge is formulated with an innovative solution and constructed with a sturdy design to ensure reliability and better productivity in the small office. The HP Q2624A Black toner cartridge ensures professional quality in text and graphics throughout the life of the cartridge. Engineered for perfection, the HP 24A Black LaserJet toner cartridge is fast and dependable from first print to last and aims to deliver immaculate results all the time. The HP Q2624A toner is an all-in-one cartridge that is easy to manage and maintain for hassle-free printing because the drum and toner are integrated which means fewer cartridges to replace.', '808736420617', '', 333, 142, 198, 730, 'HP', '1', '', 0, 'Single', 'S-Q2624A'),
