(254, 253, 'HP 300 Tri-colour Ink Cartridges let you easily print vivid colour documents, reports and letters at an affordable price. This Original HP ink cartridge is designed to deliver user-friendly features and consistent, reliable performance.', 'The genuine Black & tri-colour HP 300 ink cartridge multipack allows you to buy your ink cartridges in a twin pack to save time and money. This original HP CN637EE ink cartridge twin pack contains 1 x Black HP 300 ink cartridge (CC640EE) and 1 x tri-colour HP 300 ink cartridge (CC643EE). HP 300 printer cartridges are specially formulated with long-lasting HP ink that resists fading and produces crisp text and colour quality that maintains its perfect image quality for many years to come. The Black HP 300 ink cartridge produces laser-like text characters to give your documents a professional touch. Meanwhile, printing vibrant, eye-catching graphics is even easier because the tri-colour HP 300 ink cartridge gives you a combination of Cyan, Magenta and Yellow inks in a single cartridge that you can easily install alongside your Black HP CC640EE cartridge. Pay less for your ink and buy your Black and colour cartridges together in the cost-effective HP CN637EE multipack.', '884962770160', '', 38, 117, 170, 111, 'HP', '1,2,3,4', '', 0, 'Single', 'S-CN637EE'),
