(257, 256, 'HP 301 Tri-colour Ink Cartridges are designed to deliver user-friendly features, including technology that lets you finish printing a critical job even when youre low on a specific ink. Easily print vivid colour documents, reports and letters.', 'The genuine tri-colour HP 301 ink cartridge is designed to print eye-catching graphics that will bring your pages to life. Containing original HP ink, this tri-colour HP 301 printer cartridge is also known as the HP CH562EE ink cartridge and uses specially formulated dye-based ink to bring you superb colour vibrancy. The tri-colour HP301 cartridge contains Cyan, Magenta and Yellow inks within a single, compact cartridge. Easy to use and replace, this convenient tri-colour HP CH562EE inkjet cartridge produces vivid colours and sharp images that resist fading for decades. When used in-conjunction with ColorLok papers, this tri-colour HP 301 ink will deliver enhanced image quality with richer, brighter graphics as well as faster drying times that result in reduced smearing. With an estimated capacity of 165 pages, the tri-colour HP No.301 cartridge offers an inexpensive solution for printing in vibrant colours.', '884962894484', '', 37, 113, 115, 60, 'HP', '2,3,4', '', 0, 'Single', 'S-CH562EE'),
(258, 257, 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text.', 'HP 21/22 Combo-pack Inkjet Print Cartridges reduce printing costs and save time. Get all the Black and tri-colour ink you need to print brilliant, long-lasting photos and graphics, and professional-looking documents with laser-quality Black text. Ideal for families and personal users producing a large-volume of everyday prints. Perfect for greeting cards, letters, e-mail, photos and graphics. Get results you can count on across a broad range of plain papers and speciality media. Save money with economical and convenient HP Combo-pack Inkjet Print Cartridges. Contains one Black and one tri-colour Inkjet print cartridge to meet your everyday printing needs, and costs less than two individual cartridges bought separately. HP 21 and 22 Inkjet Print Cartridges produce professional-looking documents and true-to-life, colour-accurate photos. Print crisp, laser-quality text for your letters and reports, and brilliant, long-lasting colour photographs and graphics.', '883585651719', '', 38, 117, 170, 123, 'HP', '1,2,3,4', '', 0, 'Single', 'S-SD367AE'),
