(261, 260, 'The genuine high capacity Black Epson C13T12914011 ink cartridge gives you more Epson DURABRrite Ultra Ink for your money and allows you to print with maximum cost-efficiency.', 'The genuine high capacity Black Epson C13T12914010 ink cartridge gives you more Epson DURABRrite Ultra Ink for your money and allows you to print with maximum cost-efficiency. This high capacity Black Epson T1291 ink cartridge prints perfectly formed Black text and sharp images onto a range of paper types. Siutable for use on plain, glossy or matte type papers, this versatile Epson C13T129140 ink is smudge-proof, water-resistant and lightfast, making Epson T1291 ink the perfect solution for creating durable prints and archival documents. Containing resin-caoted pigment ink, the Black Epson T1291 ink cartridge gives you laser-like text reproduction and comes in a high capacity cartridge to deliver a low cost-per-page output. Constructed from official Epson parts, this original Black Epson T1291 cartridge comes in an independent ink tank to maximise cartridge life and bring you better value.', '8715946494500', '', NULL, NULL, NULL, NULL, 'EPSON', '1', '', 0, 'Single', 'S-C13T12914011'),
