(269, 268, 'Get the best results out of your HP printing system. HP Smart technology and chemically-grown toner formulas in HP colour LaserJet print cartridges work with your printer to deliver accurate, consistent colour and reliable, cost-effective performance. Accurate colour, precise image reproduction and crisp, sharp text every time you print. Chemically-grown toner and HP Smart printing system technology deliver consistent results and reliable performance throughout the life of the cartridge.', 'The genuine high capacity Black HP 90X toner twin pack, also known as the HP CE390XD Black dual pack, is a solution for a small to medium-sized office that needs an economical way to reduce the cost-per-page ratio. The HP 90X multipack contains two high capacity Black HP CE390X toners and offers better value for money than individual cartridges. The CE390XD dual pack can also save time and improve productivity without compromising professional-quality results. Users can also reduce their time shopping for replacement cartridges because a pack allows you to keep a spare HP 90X toner on hand for when you run out. With the 90X high capacity toner pack, it is possible to enjoy crisper and sharper output at an extended period. These genuine high capacity Black HP 90X toner supplies are also part of the free recycling programme, HP Planet Partners.', '5053839252664', '', 390, 400, 332, 50, 'HP', '1', '', 0, 'Single', 'S-CE390XD');
