(270, 269, 'Kodak\\''s proprietary pigment-based ink technology provides the vibrancy of dye-based inks, but the durability of pigment-based inks so you get sharp text, brilliant colour documents and photos that dry instantly, are water resistant and last a lifetime. All from the only company that offers you the lowest total ink replacement cost.', 'The genuine Black Kodak 30 ink cartridge is the official replacement Black ink cartridge for your Kodak printer. Featuring superior quality Kodak ink, this original Black Kodak No.30 printer ink delivers sharp, clear text and images. Kodak\\''s proprietary pigment-based ink, contained within every Kodak No.30 cartridge, ensures that your documents are durable, long-lasting and professional. The fast drying formula of Kodak 30B ink offers enhanced protection against smudging and smearing, taking the hassle out of inkjet printing.', '41773952332', '', NULL, NULL, NULL, NULL, 'Kodak', '1', '', 0, 'Single', 'S-3952330'),
(271, 270, 'The genuine high capacity Black Kodak 30XL ink cartridge allows you to print for longer in crisp Black ink. Giving you twice as much ink as the Kodak 30 cartridge, this original high capacity Black Kodak 30XL printer cartridge saves you money without compromising the quality of your documents.', 'The genuine high capacity Black Kodak 30XL ink cartridge allows you to print for longer in crisp Black ink. Giving you twice as much ink as the Kodak 30 cartridge, this original high capacity Black Kodak 30XL printer cartridge saves you money without compromising the quality of your documents. Featuring specially formulated pigment ink, this high capacity Black Kodak No.30XL ink cartridge produces high quality output that is both water and fade resistant, drying instantly on your page to prevent smudging. Easy to install or replace, this high capacity Black Kodak 30XL inkjet cartridge is the ideal solution for printing professional quality office documents at a low cost-per-page. Print up to 670 pages from this high capacity Kodak N30XL cartridge and get finely detailed text and images from start to finish.', '41773952363', '', NULL, NULL, NULL, NULL, 'Kodak', '1', '', 0, 'Single', 'S-3952363'),
(272, 271, 'Colour pages can be more vibrant with the genuine Lexmark 15 tri-colour return program ink cartridge.', 'Colour pages can be more vibrant with the genuine Lexmark 15 tri-colour return program ink cartridge. Suitable for small offices and home users, the Lexmark 018C2110E tri-colour ink is formulated for high quality photos and better graphics without compromising the speed and performance of the printer. The Lexmark 15 ink cartridge is resilient and easy to install, and when it runs out of ink, users can return it to Lexmark so it can be re-manufactured or recycled. The Lexmark 15 ink cartridge includes the colours Cyan, Yellow, and Magenta, and each can mix well with one another to create a wide variety of colours to ensure accurate output. The Lexmark 018C2110E ink is compatible with a wide range of media types', '734646964630', '', NULL, NULL, NULL, NULL, 'Lexmark', '2,3,4', '', 0, 'Single', 'S-018C2110E '),
(273, 272, 'This high-resolution Black cartridge uses Lexmark\\''s exclusive pigmented Black ink. This ink coupled with an increased number of printhead nozzles and swath size, enables consumers to consistently produce high-quality prints at unprecedented print speeds. This cartridge contains redundant nozzles, which help ensure consistent print quality.', 'High resolution monochrome graphics and text documents can be more presentable when the genuine Lexmark 14 Black return program ink cartridge is used. The Lexmark 14 ink cartridge is engineered for resiliency and versatility, so it is compatible with a wide range of paper types and speciality media. The cartridge of the Lexmark 018C2090E Black ink is an all-in-one product with redundant nozzles that guarantee consistency on every page, so if one nozzle fails or gets clogged, the other continues to work.', '734646964586', '', NULL, NULL, NULL, NULL, 'Lexmark', '1', '', 0, 'Single', 'S-18C2090E'),
(274, 273, 'This high-resolution Black cartridge uses Lexmark\\''s exclusive pigmented Black ink. This ink coupled with an increased number of printhead nozzles and swath size, enables consumers to consistently produce high-qualityprints at unprecedented print speeds.', 'Get professional documents consistently with the Lexmark 18C1523E Black ink. The Lexmark 23 ink is designed to deliver fade-resistant output with the pigmented ink supplied in these cartridges. Texts are sure to be clear when you use the Lexmark 23 Black ink. The Lexmark 23 ink cartridge can also be used for delivering high-quality images. Opt for the Black Lexmark 18C1523E ink, it can help increase productivity while lowering running costs. The Black Lexmark 23 ink has an average page yield of 215 pages. The Lexmark 23 will effortlessly fit into your compatible printer.', '734646961325', '', NULL, NULL, NULL, NULL, 'Lexmark', '1', '', 0, 'Single', 'S-018C1523E'),
