(276, 275, 'The Lexmark 43XL colour print cartridge contains evercolour2 ink; its unique pigment based formulation combines exceptional resilience with improved archivability', 'Print more colourful photographs and full-colour documents using the genuine Lexmark 43XL colour ink cartridge. The genuine Lexmark 18Y0143E tri-colour ink creates high quality and consistent results on plain paper and select speciality media because of the unique pigment-based Evercolor 2 ink formulation. Superior water resistance and exceptional lightfastness are added qualities to the printouts that are produced using the genuine Lexmark 43XL ink jet cartridge. The ink tank contains more genuine Lexmark 18Y0143E cartridge ink, so it lasts up to 500 pages and eliminates the need for a replacement soon', '734646964517', '', 38, 70, 98, 60, 'Lexmark', '2,3,4', '', 0, 'Single', 'S-18YX143E'),
