(278, 277, 'Individual ink cartridges allow for more control over the ink you use- replace only the colour you need. Print brilliant photos with precise, consistent drop placement. Vizix print technology delivers vibrant, crisp prints from the first print to the last. ', 'The genuine high capacity Yellow return program Lexmark 100XL ink cartridge is a high performance cartridge containing Lexmark\\''s revolutionary Vizix ink. Vizix print technology sets new boundaries for inkjet printing by offering you cutting-edge performance at a remarkably low cost. This high capacity Yellow Lexmark 100 XL ink uses consistent ink-droplet placement for exceptional colour accuracy. The independent ink tank design of the high capacity Yellow Lexmark 100 XL cartridge makes printer maintenance effortless and reduces waste because you only replace a specific colour when it runs out. This cartridge is also known as Lexmark 14N0171E ink and is a return program cartridge that is kind on both your budget and the environment. This return program Lexmark 14N0171E cartridge brings professional quality printing to the everyday home or office user and allows you to produce eye-catching graphics and lab-quality photos with true-to-life image quality. Better still, the high capacity return program Lexmark 100 XL cartridge contains three times as many pages as the standard Lexmark cartridge and features an estimated capacity of 600 pages', '734646967174', '', 28, 98, 140, 40, 'Lexmark', '4', '', 0, 'Single', 'S-14N1071E'),
