(434, 432, 'Matte Black LUCIA Monochrome pigment ink Reduces the bronzing effect Improved saturation Larger individual ink tanks Manufacturer code: PGI-29MBK; 4868B001.\nThe Canon PGI-29MBK matte black ink cartridge is part of your Canons 12 colour LUCIA ink system which helps achieve professional gallery quality prints.', 'With a special pigment based formulation, Canon PGI29MBK matte black ink contained in each Canon 4868B001AA ink tank delivers exceptional quality in terms of image detail and text sharpness. Improve your machine\\''s performance by using the genuine Canon PGI-29MBK high capacity matte black cartridge, built specially to optimise printing. Canon PGI29MBK matte black ink is best for printing graphics and images, offering more vibrant shades and smoother transitions. Pigment-based inks like the reserve that goes into a Canon PGI-29MBK ink cartridge are known for longer shelf life, which means that stocking up several cartridges at a time won\\''t be a problem, especially if you do bulk printing on a regular basis.', '4960999681887', '', 170, 110, 20, 82, 'Canon', '', '', 0, 'Single', 'S-4868B001'),
(435, 433, 'Matte Black LUCIA Monochrome pigment ink Reduces the bronzing effect Improved saturation Larger individual ink tanks Manufacturer code: PGI-29MBK; 4868B001.\nThe Canon PGI-29MBK matte black ink cartridge is part of your Canons 12 colour LUCIA ink system which helps achieve professional gallery quality prints.', 'With a special pigment based formulation, Canon PGI29MBK matte black ink contained in each Canon 4868B001AA ink tank delivers exceptional quality in terms of image detail and text sharpness. Improve your machine\\''s performance by using the genuine Canon PGI-29MBK high capacity matte black cartridge, built specially to optimise printing. Canon PGI29MBK matte black ink is best for printing graphics and images, offering more vibrant shades and smoother transitions. Pigment-based inks like the reserve that goes into a Canon PGI-29MBK ink cartridge are known for longer shelf life, which means that stocking up several cartridges at a time won\\''t be a problem, especially if you do bulk printing on a regular basis.', '496099968190', '', 169, 110, 27, 100, 'Canon', '', '', 0, 'Single', 'S-4869B001'),
(436, 434, 'Genuine Canon Consumable, PGI-29, PIXMA PRO 1', 'Canon PGI29 Photo Cyan Lucia Ink', '4053162253889', '', 169, 110, 27, 100, 'Canon', '', '', 0, 'Single', 'S-4876B001'),
(437, 435, 'Genuine Canon Consumable, PGI-29, PIXMA PRO 1', 'Canon PGI29 Photo Magenta Lucia Ink', '496099968206', '', 169, 110, 27, 100, 'Canon', '', '', 0, 'Single', 'S-4877B001'),
(438, 436, 'Genuine Canon Consumable/ PGI-29/ PIXMA PRO 1', 'Lucia pigment ink system expands the color gamut with improved saturation of colors and darker, deeper blacks. This system allows the professional photographer to achieve new levels of skin tone reproduction, accuracy and quality, so your prints exhibit stunning detail.', '4960999682082', '', 169, 110, 27, 100, 'Canon', '', '', 0, 'Single', 'S-4878B001'),
(439, 437, 'Genuine Canon Consumable / PGI-29 / PIXMA PRO 1', 'Compatible with thecanon pixma pro-1 printer, the canonpgi-29dgy ink cartridgeensures high quality prints\n12 month manufacturer\\''s warranty included', '4960999682020', '', 169, 110, 27, 100, 'Canon', '', '', 0, 'Single', 'S-4875B001'),
(440, 438, 'Genuine Canon Consumable in Extra Value Twin Pack, PGI-35', 'Canon PGI35 Ink Twin Pack', '8714574572444', '', 154, 115, 52, 41, 'Canon', '1', '', 0, 'Single', 'S-1509B012'),
(441, 439, '', '', '4960999273020', '', 214, 130, 48, 181, 'Canon', '1', '', 0, 'Single', 'S-0628B001'),
(442, 440, 'One genuine Canon black ink cartridge (Canon PGi-7BK). This Canon cartridge contains 22ml of ink.', 'The Canon PGi-7 Lucia Black Ink Tank is exclusive to the Canon PIMXA iX7000 Inkjet Business Printer and Pixma MX7600 Office All-In-One Printer. The specially formulated Canon PGI-7 Pigment Black Ink Tank is a large capacity pigment ink tank that delivers exceptional document quality and remarkable durability. Your documents will be long-lasting and have crisp, smudge-resistant text for professional output.', '4960999534657', '', 140, 100, 30, 50, 'Canon', '1', '', 0, 'Single', 'S-2444B001'),
(443, 441, '', '', '4960999534619', '', 140, 100, 30, 89, 'Canon', '', '', 0, 'Single', 'S-2442B001'),
(444, 442, 'DELL JF333/592-10186 - 725/810 TRI COLOUR INK 725 810', 'Dell Original Inkjet Cartridge. The Dell Colour Printer 725 uses a single tri-colour cartridge for all your black and colour printing. This cartridge provides great quality output and you only have one cartridge to replace and install. ', '5018206267900', '', 108, 52, 26, 41, 'Dell', '2,3,4', '', 0, 'Single', 'S-592-10177'),
(445, 443, 'Produces high-resolution printouts with clear images and sharp images', '', '5391519087886', '', NULL, NULL, NULL, NULL, 'Dell', '1', '', 0, 'Single', 'S-592-10094'),
(446, 444, 'Produces high-resolution printouts with clear images and sharp images', '', '5391519088005', '', NULL, NULL, NULL, NULL, 'Dell', '1', '', 0, 'Single', 'S-592-10256'),
(447, 445, 'High capacity colour cartridge', 'Dell Original High Yield Colour Inkjet Cartridge. This high capacity colour cartridge gives you approximately twice the number of pages than the standard capacity cartridge. ', '5055344655749', '', NULL, NULL, NULL, NULL, 'Dell', '2,3,4', '', 0, 'Single', 'S-592-10257'),
(448, 446, 'Original Epson printer ribbon', 'EPSON FABRIC RIBBON BLACK C13S015066 ZEBRA Ribbon', '5051964081395', '', 190, 120, 40, 200, 'Epson', '1', '', 0, 'Single', 'S-C13S015066');
